CaptainDataTemplateLang["地球联合军第七轨道舰队所属，有“恩底弥翁之鹰”之名的王牌机师（恩底弥翁是古希腊神话中深受月神阿尔特弥斯钟爱的少年，穆曾在月面恩底弥翁环形山击坠4架金而得到这个称号），阶级为上尉（后晋升为少校）。因担任高达的护卫任务而来到赫利奥波利斯，在高达被强夺后成为大天使号所属的机师。在宇宙中所使用的机种是莫比乌斯零式，在地球上所使用的机种是空中霸王。对于大和而言，穆是兄长般的存在；另外，穆与ZAFT军的拉乌是夙敌。自然人。"] = "地球联合军第七轨道舰队所属，有“恩底弥翁之鹰”之名的王牌机师（恩底弥翁是古希腊神话中深受月神阿尔特弥斯钟爱的少年，穆曾在月面恩底弥翁环形山击坠4架金而得到这个称号），阶级为上尉（后晋升为少校）。因担任高达的护卫任务而来到赫利奥波利斯，在高达被强夺后成为大天使号所属的机师。在宇宙中所使用的机种是莫比乌斯零式，在地球上所使用的机种是空中霸王。对于大和而言，穆是兄长般的存在；另外，穆与ZAFT军的拉乌是夙敌。自然人。"
