CaptainDataTemplateLang["宇宙世纪六十七年，哈曼出生于side3的core3号殖民地，其后因父亲工作上的需求，搬至吉翁首都―祖姆城居住。其父在德金公王侧近任职，也有说法指称其拥有将军之职，关于其母之情报则一切皆无。哈曼有一个年龄差距甚远的姐姐，是多兹鲁 扎比的爱妾。"] = "宇宙世纪六十七年，哈曼出生于side3的core3号殖民地，其后因父亲工作上的需求，搬至吉翁首都―祖姆城居住。其父在德金公王侧近任职，也有说法指称其拥有将军之职，关于其母之情报则一切皆无。哈曼有一个年龄差距甚远的姐姐，是多兹鲁 扎比的爱妾。"
