CaptainDataTemplateLang["泰坦斯机师，是在青之诺亚中对三台RX-178高达Mk-Ⅱ进行测试的测试机师之一，后在驾驶RMS-108玛拉塞于近地球轨道攻击卡缪 维丹驾驶的RX-178高达Mk-Ⅱ时，由于降落地球的降落伞被卡缪击毁而导致机体在突入地球时损毁，阵亡。"] = "泰坦斯机师，是在青之诺亚中对三台RX-178高达Mk-Ⅱ进行测试的测试机师之一，后在驾驶RMS-108玛拉塞于近地球轨道攻击卡缪 维丹驾驶的RX-178高达Mk-Ⅱ时，由于降落地球的降落伞被卡缪击毁而导致机体在突入地球时损毁，阵亡。"
CaptainDataTemplateLang["捷利特 梅萨"] = "捷利特 梅萨"
CaptainDataTemplateLang["泰坦斯青年军官，MS驾驶员，是个出色的人材，无论观看大局的眼光还是MS驾驶技术都很出众，但缺点比较冲动。曾在Side7时听到花园丽说出的卡缪 维丹的名字时说了一句“卡缪，这不是女人的名字吗？”。于是引得卡缪 维丹对其大打出手，引发了两人的仇恨史。在卡缪 维丹因殴打泰坦斯军官而被捕到释放的期间，捷利特其进行了RX-178高达Mk-Ⅱ的试飞工作，后因躲避不及而撞上了卡缪所在大楼，间接为卡缪偷走高达Mk-Ⅱ投靠奥古提供了机会。捷利特后来得到命令在奥古抢夺人质时射爆装有人质的容器（人质为卡缪 维丹的母亲），于是捷利特在不知情的情况下在卡缪 维丹面前射杀卡缪 维丹的母亲。"] = "泰坦斯青年军官，MS驾驶员，是个出色的人材，无论观看大局的眼光还是MS驾驶技术都很出众，但缺点比较冲动。曾在Side7时听到花园丽说出的卡缪 维丹的名字时说了一句“卡缪，这不是女人的名字吗？”。于是引得卡缪 维丹对其大打出手，引发了两人的仇恨史。在卡缪 维丹因殴打泰坦斯军官而被捕到释放的期间，捷利特其进行了RX-178高达Mk-Ⅱ的试飞工作，后因躲避不及而撞上了卡缪所在大楼，间接为卡缪偷走高达Mk-Ⅱ投靠奥古提供了机会。捷利特后来得到命令在奥古抢夺人质时射爆装有人质的容器（人质为卡缪 维丹的母亲），于是捷利特在不知情的情况下在卡缪 维丹面前射杀卡缪 维丹的母亲。"
CaptainDataTemplateLang["夏亚 阿兹纳布尔"] = "夏亚 阿兹纳布尔"
CaptainDataTemplateLang["夏亚是吉翁共和国国父吉恩 什姆 戴肯之子；其父在失意期间在酒吧遇到了当时的酒吧歌女并坠入爱河；出生于宇宙世纪0059年，九年之后他的父亲逝世。和妹妹阿尔黛西亚 戴肯由父亲的亲信金巴 拉尔带到地球，途中9岁的卡斯巴尔用一台钢坦克打爆三台钢坦克，并以革命政治家玛斯的养子之名作为掩护，改名爱德华 玛斯。途中卡斯巴尔设计与夏亚互换身份，结果真正的夏亚被基西莉亚 扎比安排的事故暗杀。"] = "夏亚是吉翁共和国国父吉恩 什姆 戴肯之子；其父在失意期间在酒吧遇到了当时的酒吧歌女并坠入爱河；出生于宇宙世纪0059年，九年之后他的父亲逝世。和妹妹阿尔黛西亚 戴肯由父亲的亲信金巴 拉尔带到地球，途中9岁的卡斯巴尔用一台钢坦克打爆三台钢坦克，并以革命政治家玛斯的养子之名作为掩护，改名爱德华 玛斯。途中卡斯巴尔设计与夏亚互换身份，结果真正的夏亚被基西莉亚 扎比安排的事故暗杀。"
CaptainDataTemplateLang["露 卢卡"] = "露 卢卡"
CaptainDataTemplateLang["奥古志愿兵、为将MSZ-010ZZ高达的核心战机送到拟 亚加玛而来。机师的服装上有着流星的标志，后成为MSZ-006Z高达的机师。露本人有着明确的意志和刚强的性格、开始在战斗中会与捷多 亚西塔唱反调、后来也慢慢地融入到了朋友当中。而且为葛雷米 托托单方面的求爱所困扰、在阿克西斯的决战时将其击破后流下了眼泪。"] = "奥古志愿兵、为将MSZ-010ZZ高达的核心战机送到拟 亚加玛而来。机师的服装上有着流星的标志，后成为MSZ-006Z高达的机师。露本人有着明确的意志和刚强的性格、开始在战斗中会与捷多 亚西塔唱反调、后来也慢慢地融入到了朋友当中。而且为葛雷米 托托单方面的求爱所困扰、在阿克西斯的决战时将其击破后流下了眼泪。"
CaptainDataTemplateLang["帕普迪马斯 西洛克"] = "帕普迪马斯 西洛克"
CaptainDataTemplateLang["地球联邦政府木星资源采探船朱庇特里斯号的舰长，在暗杀加米托夫 海曼后，成为泰坦斯的的实权掌握者，在格里普斯战争的最后战役中，被卡缪 维丹驾驶MSZ-006Z高达杀死。西罗克是木星的氦3（热核反应炉主要燃料）采探队及母舰朱庇特里斯号的指挥官。U.C.0087年4月末，当采探任务完结回程之时，身为采探船朱庇特里斯号船长的西罗克将船上所载有的氦3转赠予泰坦斯的领导人加米托夫，并歃血为盟，从而代表木星船团加入泰坦斯。加米托夫的原意是将帕普迪马斯 西罗克培养成为控制当时得势独大的巴斯高的人物，因而获得不少机会与资源，其中便包括代理泰坦斯旗舰多戈斯 基亚舰长一事。其初次登场便驾驶着自己设计开发的PMX-000梅萨拉以一击脱离的作战方式收割奥古的舰队和MS，成功击破两艘萨拉米斯战舰以及多部MS。"] = "地球联邦政府木星资源采探船朱庇特里斯号的舰长，在暗杀加米托夫 海曼后，成为泰坦斯的的实权掌握者，在格里普斯战争的最后战役中，被卡缪 维丹驾驶MSZ-006Z高达杀死。西罗克是木星的氦3（热核反应炉主要燃料）采探队及母舰朱庇特里斯号的指挥官。U.C.0087年4月末，当采探任务完结回程之时，身为采探船朱庇特里斯号船长的西罗克将船上所载有的氦3转赠予泰坦斯的领导人加米托夫，并歃血为盟，从而代表木星船团加入泰坦斯。加米托夫的原意是将帕普迪马斯 西罗克培养成为控制当时得势独大的巴斯高的人物，因而获得不少机会与资源，其中便包括代理泰坦斯旗舰多戈斯 基亚舰长一事。其初次登场便驾驶着自己设计开发的PMX-000梅萨拉以一击脱离的作战方式收割奥古的舰队和MS，成功击破两艘萨拉米斯战舰以及多部MS。"
CaptainDataTemplateLang["诺利斯 巴卡德"] = "诺利斯 巴卡德"
CaptainDataTemplateLang["吉翁贵族萨哈林家族的仆人，忠心于基尼亚斯 萨哈林和艾娜 萨哈林，尤其对于艾娜来说，是如同父亲一般的人物。基尼亚斯在吉翁军东南亚的秘密基地中研发阿普撒拉斯时，诺利斯则负责基地的守卫工作。一年战争后期，为了掩护位于东南亚秘密基地的吉翁军撤退，诺利斯 巴卡德东南亚混合机械大队交战，并成功击破三架RX-75先行量产型钢坦克，随后与RX-79高达展开了一场死斗，最终遭到击破，诺利斯光荣牺牲。"] = "吉翁贵族萨哈林家族的仆人，忠心于基尼亚斯 萨哈林和艾娜 萨哈林，尤其对于艾娜来说，是如同父亲一般的人物。基尼亚斯在吉翁军东南亚的秘密基地中研发阿普撒拉斯时，诺利斯则负责基地的守卫工作。一年战争后期，为了掩护位于东南亚秘密基地的吉翁军撤退，诺利斯 巴卡德东南亚混合机械大队交战，并成功击破三架RX-75先行量产型钢坦克，随后与RX-79高达展开了一场死斗，最终遭到击破，诺利斯光荣牺牲。"
CaptainDataTemplateLang["迪奥 麦克斯维尔"] = "迪奥 麦克斯维尔"
CaptainDataTemplateLang["生长在L2殖民地群的少年，早年父母同样因战乱而双亡但迪奥保有自身的名字。迪奥流浪一段时间后被麦克斯维尔教会收留，与教会中的神父、修女们相处融洽。但后来麦克斯维尔教会因为被反地球统一联合军的基地组织成员当做临时基地，因此被地球统一联合军视为叛乱分子而趁机加以镇压。"] = "生长在L2殖民地群的少年，早年父母同样因战乱而双亡但迪奥保有自身的名字。迪奥流浪一段时间后被麦克斯维尔教会收留，与教会中的神父、修女们相处融洽。但后来麦克斯维尔教会因为被反地球统一联合军的基地组织成员当做临时基地，因此被地球统一联合军视为叛乱分子而趁机加以镇压。"
CaptainDataTemplateLang["积古斯 玛吉斯"] = "积古斯 玛吉斯"
CaptainDataTemplateLang["原名米利亚尔特 匹斯克拉福特，原桑古王国直系后裔，自幼便与特列斯是好友，但是由于国家被联邦消灭，一直不得不隐姓埋名带着面具以积古斯的名字行动。其内心非常希望给桑古王国及自己的父亲报仇，于是加入OZ。因为摘下面具便是倡导和平的桑古王国的王子，所以一般驾驶机体作战的时候都是以积古斯（身为一名士兵）的身份。是莉莉娜的亲哥哥，随身都带着一枚镶有莉莉娜幼年时代的照片的坠落。在北极与希罗进行决斗时被诺因戳破秘密才得以与莉莉娜相认。有闪光伯爵称号的男人。为了使世界和平，他决定用残酷的战争让人类了解战争的可怕，加入了以同样目标为目的的组织“白色芬古”。在最后的决斗时决定用终极宇宙战舰利布拿撞向地球，但是被希罗阻止。最后自己代替希罗自爆，损坏了利布拿的动力系统后本人也失踪。"] = "原名米利亚尔特 匹斯克拉福特，原桑古王国直系后裔，自幼便与特列斯是好友，但是由于国家被联邦消灭，一直不得不隐姓埋名带着面具以积古斯的名字行动。其内心非常希望给桑古王国及自己的父亲报仇，于是加入OZ。因为摘下面具便是倡导和平的桑古王国的王子，所以一般驾驶机体作战的时候都是以积古斯（身为一名士兵）的身份。是莉莉娜的亲哥哥，随身都带着一枚镶有莉莉娜幼年时代的照片的坠落。在北极与希罗进行决斗时被诺因戳破秘密才得以与莉莉娜相认。有闪光伯爵称号的男人。为了使世界和平，他决定用残酷的战争让人类了解战争的可怕，加入了以同样目标为目的的组织“白色芬古”。在最后的决斗时决定用终极宇宙战舰利布拿撞向地球，但是被希罗阻止。最后自己代替希罗自爆，损坏了利布拿的动力系统后本人也失踪。"
CaptainDataTemplateLang["希罗 尤尔"] = "希罗 尤尔"
CaptainDataTemplateLang["生长于L1殖民地群的少年，有东洋地区的血统。养父与母亲因早年战乱而双亡，因此希罗从小并没有留下任何亲人的记忆，甚至连自己名字都不知道。后来希罗被错杀殖民地领袖希罗 尤尔的恐怖分子也是希罗的父亲亚汀 罗所收养，在这其中接受了些许的战技与生存指导，而亚汀始终未与希罗相认，但后来该名恐怖分子被迪基姆杀死后，希罗又成为孤单一人。不久后希罗在街上遇上自称J博士的老人，J博士认为希罗足以成为一位战士，因此说服希罗并将他带到基地组织加以训练，最终成为飞翼高达的驾驶员。"] = "生长于L1殖民地群的少年，有东洋地区的血统。养父与母亲因早年战乱而双亡，因此希罗从小并没有留下任何亲人的记忆，甚至连自己名字都不知道。后来希罗被错杀殖民地领袖希罗 尤尔的恐怖分子也是希罗的父亲亚汀 罗所收养，在这其中接受了些许的战技与生存指导，而亚汀始终未与希罗相认，但后来该名恐怖分子被迪基姆杀死后，希罗又成为孤单一人。不久后希罗在街上遇上自称J博士的老人，J博士认为希罗足以成为一位战士，因此说服希罗并将他带到基地组织加以训练，最终成为飞翼高达的驾驶员。"
