CaptainDataTemplateLang["十字先锋边境，当时还在边境学校就读，过着一般生活的贝拉（17岁）被卷入袭击之中，在和西布克 阿诺等人避难的时候遇见了自己前来迎接自己的十字先锋军，在得知自己的真实身份后极其动摇，跟随十字先锋一起回到了罗纳家；在回到罗纳家后十分担心当时赶来营救自己的西布克，对西布克有淡淡的好感。 而后在罗纳家遇到了自己数十年未见的祖父，宇宙贵族主义的提倡者―麦兹亚 罗纳，后者希望贝拉成为宇宙巴比伦的象征，也就是成为帝国的女王，当时的贝拉极其担心西布克，再加上目睹联邦军的所作所为后，决定答应祖父的要求，即位为宇宙巴比伦女王。"] = "十字先锋边境，当时还在边境学校就读，过着一般生活的贝拉（17岁）被卷入袭击之中，在和西布克 阿诺等人避难的时候遇见了自己前来迎接自己的十字先锋军，在得知自己的真实身份后极其动摇，跟随十字先锋一起回到了罗纳家；在回到罗纳家后十分担心当时赶来营救自己的西布克，对西布克有淡淡的好感。 而后在罗纳家遇到了自己数十年未见的祖父，宇宙贵族主义的提倡者―麦兹亚 罗纳，后者希望贝拉成为宇宙巴比伦的象征，也就是成为帝国的女王，当时的贝拉极其担心西布克，再加上目睹联邦军的所作所为后，决定答应祖父的要求，即位为宇宙巴比伦女王。"
CaptainDataTemplateLang["西布克 阿诺"] = "西布克 阿诺"
CaptainDataTemplateLang["西布克原先是殖民卫星边境工程学院的一名普通学生；宇宙世纪0123年3月16日，死亡先锋袭击边境IV后，与朋友一起躲避到了演习舰宇宙方舟上。期间因为自己母亲的关系和身为工程师的资质而成为了新机体高达F91的驾驶员，并展开了与死亡先锋的一系列作战。"] = "西布克原先是殖民卫星边境工程学院的一名普通学生；宇宙世纪0123年3月16日，死亡先锋袭击边境IV后，与朋友一起躲避到了演习舰宇宙方舟上。期间因为自己母亲的关系和身为工程师的资质而成为了新机体高达F91的驾驶员，并展开了与死亡先锋的一系列作战。"
CaptainDataTemplateLang["托比 阿罗纳克斯"] = "托比 阿罗纳克斯"
CaptainDataTemplateLang["15岁，拥有很大潜能的新人类。本为地球圈前往木星圈的交换留学生，但遇到宇宙海盗后，发现了木星帝国的秘密，因此决定加入死亡先锋，一起对抗木星帝国。故事前期只负责驾驶小兵机，在金凯度的教导下和新人类能力觉醒后，成为新死亡先锋军的主力之一，故事后期在别的贵族主义支持派中取得海盗高达，并与木星帝国的总统，古拉克斯 杜加奇进行决战。"] = "15岁，拥有很大潜能的新人类。本为地球圈前往木星圈的交换留学生，但遇到宇宙海盗后，发现了木星帝国的秘密，因此决定加入死亡先锋，一起对抗木星帝国。故事前期只负责驾驶小兵机，在金凯度的教导下和新人类能力觉醒后，成为新死亡先锋军的主力之一，故事后期在别的贵族主义支持派中取得海盗高达，并与木星帝国的总统，古拉克斯 杜加奇进行决战。"
