CaptainDataTemplateLang["机动战士高达独角兽主人公，Vist财团现任家主卡帝亚斯 毕斯特之子，因其母不愿意他卷入毕斯特家族的命运，在其年少时由其母亲带领离开毕斯特家族，前往其它移民星系居住。后因为母亲的死亡，被未曾想见过的父亲安排进入阿纳海姆公司下属学校学习。后与神秘少女奥黛莉 伯恩相遇，卷入了“拉普拉斯之箱”的事件之中。成为独角兽高达的机师后，留在了联邦军的拟亚加玛号，之后作为拟亚加玛号的编外人员与“带袖的”展开斗争。曾经通过感应力场与玛莉妲 库鲁斯和安杰洛 梭裴进行了高度的灵魂交流，之后与玛莉妲成为知己，与安杰洛成为死敌。"] = "机动战士高达独角兽主人公，Vist财团现任家主卡帝亚斯 毕斯特之子，因其母不愿意他卷入毕斯特家族的命运，在其年少时由其母亲带领离开毕斯特家族，前往其它移民星系居住。后因为母亲的死亡，被未曾想见过的父亲安排进入阿纳海姆公司下属学校学习。后与神秘少女奥黛莉 伯恩相遇，卷入了“拉普拉斯之箱”的事件之中。成为独角兽高达的机师后，留在了联邦军的拟亚加玛号，之后作为拟亚加玛号的编外人员与“带袖的”展开斗争。曾经通过感应力场与玛莉妲 库鲁斯和安杰洛 梭裴进行了高度的灵魂交流，之后与玛莉妲成为知己，与安杰洛成为死敌。"
