CaptainDataTemplateLang["喜欢老式的有机翼的飞机。所以在战场上还是喜欢把自己心爱的老式螺旋桨飞机模型带进自己的驾驶舱中。作战中代号名称罗密欧008。驾驶机体RGZ-95里歇尔(中期更换为DELTA PLUS，百式原型机DELTA高达的量产型），在工业七号的工厂部分战斗中救下了即将被LOTO的残骸压死的米寇特、拓也和奥黛莉 伯恩三人。之后由于家氏内部的原因以及他所在的拟亚加玛等问题，被卷入了“拉普拉斯之箱”事件中。在玛莉妲 库鲁斯离开RX-0报丧女妖后成为报丧女妖的机师。后来和巴纳吉 林克斯一起拯救了工业七号。"] = "喜欢老式的有机翼的飞机。所以在战场上还是喜欢把自己心爱的老式螺旋桨飞机模型带进自己的驾驶舱中。作战中代号名称罗密欧008。驾驶机体RGZ-95里歇尔(中期更换为DELTA PLUS，百式原型机DELTA高达的量产型），在工业七号的工厂部分战斗中救下了即将被LOTO的残骸压死的米寇特、拓也和奥黛莉 伯恩三人。之后由于家氏内部的原因以及他所在的拟亚加玛等问题，被卷入了“拉普拉斯之箱”事件中。在玛莉妲 库鲁斯离开RX-0报丧女妖后成为报丧女妖的机师。后来和巴纳吉 林克斯一起拯救了工业七号。"
