CaptainDataTemplateLang["新吉翁残党“袖章”组织的最高领导者。与夏亚一样带着面具不以真面目示人，再加上其红色的座机“新安洲”、华丽的作战风格和平时的表现，致使其被称为“夏亚再世”。事实上，他对于以密涅瓦・扎比(奥黛莉・伯恩)为首代表的旧吉翁理想不屑一顾，而且由于派系不同曾两次在亚伽马号劫持米涅芭和吉恩控制了亚伽马时试图借联邦之手杀死米涅芭。并且表面上装的很尊敬密涅瓦和旧吉翁军人，但其实是对那些人已经到了厌恶的地步(派出葛兰雪队去做危险的死亡任务之类)。同时由于与正如他自己所说，他只是一个“容器”。夏亚真正的思想和做法。"] = "新吉翁残党“袖章”组织的最高领导者。与夏亚一样带着面具不以真面目示人，再加上其红色的座机“新安洲”、华丽的作战风格和平时的表现，致使其被称为“夏亚再世”。事实上，他对于以密涅瓦・扎比(奥黛莉・伯恩)为首代表的旧吉翁理想不屑一顾，而且由于派系不同曾两次在亚伽马号劫持米涅芭和吉恩控制了亚伽马时试图借联邦之手杀死米涅芭。并且表面上装的很尊敬密涅瓦和旧吉翁军人，但其实是对那些人已经到了厌恶的地步(派出葛兰雪队去做危险的死亡任务之类)。同时由于与正如他自己所说，他只是一个“容器”。夏亚真正的思想和做法。"
