CaptainDataTemplateLang["为了不让自己看来像个女孩,她剪去原本及肩的长发,自称是[京].对一个成为灾难孤儿的八岁少女而言,在战乱之中想独立生活实在太过困难了.她每次敞开心胸都遭到背叛,不知何时她的性格变得非常地激烈.之后她与不良集团间发生了纠纷,而遭警察逮捕,其后被安置。"] = "为了不让自己看来像个女孩,她剪去原本及肩的长发,自称是[京].对一个成为灾难孤儿的八岁少女而言,在战乱之中想独立生活实在太过困难了.她每次敞开心胸都遭到背叛,不知何时她的性格变得非常地激烈.之后她与不良集团间发生了纠纷,而遭警察逮捕,其后被安置。"
