CaptainDataTemplateLang["原本生活在奥布，因为奥布与地球军交战，在战火中由于父母与妹妹被流弹爆炸波及死亡一事，促使真因为无法保护家人的愤怒而加入ZAFT成为战士。性格易怒冲动，本质却淳朴善良，极度厌恶战争，渴望和平。后因为阿斯兰・萨拉回归ZAFT，对他的思想产生了巨大的影响，与雷・扎・巴雷尔是朋友，珍视并且希望拯救的人是史黛拉・鲁西耶，最后恋人是露娜玛丽亚・霍克。由于屡屡获得惊人战绩和击落最强调整者：基拉・大和驾驶的自由高达而受到迪兰杜尔议长的肯定，成为FAITH。在最后的弥赛亚决战中与阿斯兰交锋，在经历了类似史黛拉死亡的悲剧、内心也渴望和平的真被其言语所动摇，后因精神的崩溃而被爆发的阿斯兰击落。"] = "原本生活在奥布，因为奥布与地球军交战，在战火中由于父母与妹妹被流弹爆炸波及死亡一事，促使真因为无法保护家人的愤怒而加入ZAFT成为战士。性格易怒冲动，本质却淳朴善良，极度厌恶战争，渴望和平。后因为阿斯兰・萨拉回归ZAFT，对他的思想产生了巨大的影响，与雷・扎・巴雷尔是朋友，珍视并且希望拯救的人是史黛拉・鲁西耶，最后恋人是露娜玛丽亚・霍克。由于屡屡获得惊人战绩和击落最强调整者：基拉・大和驾驶的自由高达而受到迪兰杜尔议长的肯定，成为FAITH。在最后的弥赛亚决战中与阿斯兰交锋，在经历了类似史黛拉死亡的悲剧、内心也渴望和平的真被其言语所动摇，后因精神的崩溃而被爆发的阿斯兰击落。"
