CaptainDataTemplateLang["死亡先锋黑暗先锋队队长，是死亡先锋中一名优秀的MS机师和战术家，并奉命保护贝拉・罗纳。虽然忠于死亡先锋，却也拥有自己的秘密野心。他认为世界应该由贵族来统治普通民众，并认为贝拉应该成为世界的女王。后来认为木星帝国能令贵族主义实现，便带着贵族主义的支持者挟持贝拉进行叛变，失败后撤退到木星船舰。在新死亡先锋和地球联邦军对峙时，以XM-X2ex骷髅高达X2改假冒新死亡先锋向联邦军开火，挑起双方战斗，并在混战中成功击败了西布克。但最终与奇迹复活的西布克进行第二次决战时，战死在XM-X1骷髅高达X1的热能短刀下。"] = "死亡先锋黑暗先锋队队长，是死亡先锋中一名优秀的MS机师和战术家，并奉命保护贝拉・罗纳。虽然忠于死亡先锋，却也拥有自己的秘密野心。他认为世界应该由贵族来统治普通民众，并认为贝拉应该成为世界的女王。后来认为木星帝国能令贵族主义实现，便带着贵族主义的支持者挟持贝拉进行叛变，失败后撤退到木星船舰。在新死亡先锋和地球联邦军对峙时，以XM-X2ex骷髅高达X2改假冒新死亡先锋向联邦军开火，挑起双方战斗，并在混战中成功击败了西布克。但最终与奇迹复活的西布克进行第二次决战时，战死在XM-X1骷髅高达X1的热能短刀下。"
