CaptainDataTemplateLang["奥布原五大氏族的萨哈克家的现任家主。上一次大战后，虽然脱离了奥布，但仍被赞为“奥布影之军神”，与卡嘉莉并称“奥布的女神”。她是调整者，从双生子的弟弟隆德・吉纳・萨哈克一起诞生在这个世界的瞬间开始，就为奥布而工作着。正确来说是从出生之前就开始为奥布竭尽全力了。她们为此遗传基因被调整，并且作为养子进入萨哈克家的。奥布五大氏族，能力比血缘更重视。通过贯彻这种超现实主义，作为将落后于时代的血族支配化为现实起作用的系统将其维持着。萨哈克家，与历任元首的阿斯哈家这种在表面舞台华丽地活跃的氏族不同。是从以前起就担负了有关政治的背后的工作的氏族。为此与“国家拥有的暴力”也就是军队的关系也深厚。因此，与奥布的军事产业中心的曙光社深深地联系着。"] = "奥布原五大氏族的萨哈克家的现任家主。上一次大战后，虽然脱离了奥布，但仍被赞为“奥布影之军神”，与卡嘉莉并称“奥布的女神”。她是调整者，从双生子的弟弟隆德・吉纳・萨哈克一起诞生在这个世界的瞬间开始，就为奥布而工作着。正确来说是从出生之前就开始为奥布竭尽全力了。她们为此遗传基因被调整，并且作为养子进入萨哈克家的。奥布五大氏族，能力比血缘更重视。通过贯彻这种超现实主义，作为将落后于时代的血族支配化为现实起作用的系统将其维持着。萨哈克家，与历任元首的阿斯哈家这种在表面舞台华丽地活跃的氏族不同。是从以前起就担负了有关政治的背后的工作的氏族。为此与“国家拥有的暴力”也就是军队的关系也深厚。因此，与奥布的军事产业中心的曙光社深深地联系着。"
