CaptainDataTemplateLang["夏亚是吉翁共和国国父吉恩・什姆・戴肯之子；其父在失意期间在酒吧遇到了当时的酒吧歌女并坠入爱河；出生于宇宙世纪0059年，九年之后他的父亲逝世。和妹妹阿尔黛西亚・戴肯由父亲的亲信金巴・拉尔带到地球，途中9岁的卡斯巴尔用一台钢坦克打爆三台钢坦克，并以革命政治家玛斯的养子之名作为掩护，改名爱德华・玛斯。途中卡斯巴尔设计与夏亚互换身份，结果真正的夏亚被基西莉亚・扎比安排的事故暗杀。"] = "夏亚是吉翁共和国国父吉恩・什姆・戴肯之子；其父在失意期间在酒吧遇到了当时的酒吧歌女并坠入爱河；出生于宇宙世纪0059年，九年之后他的父亲逝世。和妹妹阿尔黛西亚・戴肯由父亲的亲信金巴・拉尔带到地球，途中9岁的卡斯巴尔用一台钢坦克打爆三台钢坦克，并以革命政治家玛斯的养子之名作为掩护，改名爱德华・玛斯。途中卡斯巴尔设计与夏亚互换身份，结果真正的夏亚被基西莉亚・扎比安排的事故暗杀。"
