CaptainDataTemplateLang["特列斯・克休里那达，OZ的高官，在地球联邦的派系斗争中先隐退，暗中利用高达除掉地球联邦中的和平派一揽大权，后成为OZ的总指挥官。设想以武力统一地球圈后实现和平。曾在一对一的比剑中打败了张五飞，但在驾驶机体“托尔吉斯II”和五飞的MS战中，故意落败而战死。其政治觉悟很高，实为地球圈的和平统一而甘愿牺牲的贤人。"] = "特列斯・克休里那达，OZ的高官，在地球联邦的派系斗争中先隐退，暗中利用高达除掉地球联邦中的和平派一揽大权，后成为OZ的总指挥官。设想以武力统一地球圈后实现和平。曾在一对一的比剑中打败了张五飞，但在驾驶机体“托尔吉斯II”和五飞的MS战中，故意落败而战死。其政治觉悟很高，实为地球圈的和平统一而甘愿牺牲的贤人。"
