CaptainDataTemplateLang["原桑古王国直系后裔，自幼便与特列斯是好友，但是由于国家被联邦消灭，一直不得不隐姓埋名带着面具以积古斯的名字行动。其内心非常希望给桑古王国及自己的父亲报仇，于是加入OZ。因为摘下面具便是倡导和平的桑古王国的王子，所以一般驾驶机体作战的时候都是以积古斯（身为一名士兵）的身份。是莉莉娜的亲哥哥，随身都带着一枚镶有莉莉娜幼年时代的照片的坠落。在北极与希罗进行决斗时被诺因戳破秘密才得以与莉莉娜相认。有闪光伯爵称号的男人。为了使世界和平，他决定用残酷的战争让人类了解战争的可怕，加入了以同样目标为目的的组织“白色芬古”。在最后的决斗时决定用终极宇宙战舰利布拿撞向地球，但是被希罗阻止。最后自己代替希罗自爆，损坏了利布拿的动力系统后本人也失踪。"] = "原桑古王国直系后裔，自幼便与特列斯是好友，但是由于国家被联邦消灭，一直不得不隐姓埋名带着面具以积古斯的名字行动。其内心非常希望给桑古王国及自己的父亲报仇，于是加入OZ。因为摘下面具便是倡导和平的桑古王国的王子，所以一般驾驶机体作战的时候都是以积古斯（身为一名士兵）的身份。是莉莉娜的亲哥哥，随身都带着一枚镶有莉莉娜幼年时代的照片的坠落。在北极与希罗进行决斗时被诺因戳破秘密才得以与莉莉娜相认。有闪光伯爵称号的男人。为了使世界和平，他决定用残酷的战争让人类了解战争的可怕，加入了以同样目标为目的的组织“白色芬古”。在最后的决斗时决定用终极宇宙战舰利布拿撞向地球，但是被希罗阻止。最后自己代替希罗自爆，损坏了利布拿的动力系统后本人也失踪。"
