CaptainDataTemplateLang["阶级是中尉。游击MS小队“白色・澳洲野犬&quot;的队长。他拥有从战斗机飞行员转变为经历的经历，在一年的战争末期，在自己出身地的澳大利亚大陆进行了战斗。在小说版中，描写了作为队长一边苦恼一边摸索，完成使命的样子。特务部队的队长，不过，作为驾驶员比格斗射击善的程度，战斗能力是历代高达的主角一样的超人的领域。但是“竭尽全力”的信念一样，瞬间看穿敌人的要点和目标的观察力，根据情况从正面进攻?奇计制定作战方案力，经常保持平静最好摸索气质，朋友和司令的信任和怀疑，正确的枢轴的共存“队长”。"] = "阶级是中尉。游击MS小队“白色・澳洲野犬&quot;的队长。他拥有从战斗机飞行员转变为经历的经历，在一年的战争末期，在自己出身地的澳大利亚大陆进行了战斗。在小说版中，描写了作为队长一边苦恼一边摸索，完成使命的样子。特务部队的队长，不过，作为驾驶员比格斗射击善的程度，战斗能力是历代高达的主角一样的超人的领域。但是“竭尽全力”的信念一样，瞬间看穿敌人的要点和目标的观察力，根据情况从正面进攻?奇计制定作战方案力，经常保持平静最好摸索气质，朋友和司令的信任和怀疑，正确的枢轴的共存“队长”。"
