CaptainDataTemplateLang["西布克原先是殖民卫星边境IV工程学院的一名普通学生；宇宙世纪0123年3月16日，死亡先锋袭击边境IV后，与朋友一起躲避到了演习舰宇宙方舟上。期间因为自己母亲的关系和身为工程师的资质而成为了新机体高达F91的驾驶员，并展开了与死亡先锋的一系列作战。"] = "西布克原先是殖民卫星边境IV工程学院的一名普通学生；宇宙世纪0123年3月16日，死亡先锋袭击边境IV后，与朋友一起躲避到了演习舰宇宙方舟上。期间因为自己母亲的关系和身为工程师的资质而成为了新机体高达F91的驾驶员，并展开了与死亡先锋的一系列作战。"
