CaptainDataTemplateLang["在UC.0096年出场的玛莉妲・库鲁斯是当时新吉恩为数不多的NewType驾驶员，在众多的新吉恩男性战士中成为一枝引人注目的亮的玫瑰。普露系列第十二号人工降生出来，作为强化人拥有优秀的MS驾驶能力和冷静的判断力，在独角兽第一话中帮助葛兰雪成功摆脱追击，在工业七号的战斗中，更是大破拟亚加玛三分之二的战力。无数观众看到了梦寐以求的在机动战士高达ZZ中天真可爱的普露成年美人形象（格雷米在克隆人方面都是制造美女啊）.虽然有着悲惨的经历，但是能保持一种稳重健康的心态，劝诫米妮瓦・拉欧・扎比明白自己应持的立场，对心态失落的巴纳吉进行启发和引导，被俘后保持冷静，在和玛莎・毕斯特的对话交锋中，保持作为新吉恩军人的冷静和忠诚。优秀的军人，在明知不敌独角兽的情况下，服从命令，独自向独角兽发起进攻，战斗到最后一刻，被俘后也坚守气节。"] = "在UC.0096年出场的玛莉妲・库鲁斯是当时新吉恩为数不多的NewType驾驶员，在众多的新吉恩男性战士中成为一枝引人注目的亮的玫瑰。普露系列第十二号人工降生出来，作为强化人拥有优秀的MS驾驶能力和冷静的判断力，在独角兽第一话中帮助葛兰雪成功摆脱追击，在工业七号的战斗中，更是大破拟亚加玛三分之二的战力。无数观众看到了梦寐以求的在机动战士高达ZZ中天真可爱的普露成年美人形象（格雷米在克隆人方面都是制造美女啊）.虽然有着悲惨的经历，但是能保持一种稳重健康的心态，劝诫米妮瓦・拉欧・扎比明白自己应持的立场，对心态失落的巴纳吉进行启发和引导，被俘后保持冷静，在和玛莎・毕斯特的对话交锋中，保持作为新吉恩军人的冷静和忠诚。优秀的军人，在明知不敌独角兽的情况下，服从命令，独自向独角兽发起进攻，战斗到最后一刻，被俘后也坚守气节。"
CaptainDataTemplateLang["贾尔 张"] = "贾尔 张"
CaptainDataTemplateLang["卡帝亚斯・毕斯特的秘书兼保镖，忠诚可靠，是为数不多能够真正了解卡帝亚斯想法的男人。原本隶属于地球联邦军谍报部门，是一个谍报专家，为了探寻拉普拉斯之盒秘密的他被卡帝亚斯所拉拢，后逐渐被卡帝亚斯的人格魅力所吸引。工业七号事件之后，起初他为了给卡帝亚斯报仇而联系了葛兰雪要求合作，在接触到巴纳吉・林克斯之后，将卡帝亚斯真正的想法告诉了失落的巴纳吉，让巴纳吉重新振作起来。小说原作最后一章中，贾尔为了掩护巴纳吉回到RX-0独角兽高达上，遭新安洲的步枪直击身亡。而OVA中，贾尔驾驶ARX-014银弹牵制NZ-999新吉翁号，为巴纳吉回到独角兽高达上争取时间，最终机体被新吉翁号打破，幸得巴纳吉所救而获。"] = "卡帝亚斯・毕斯特的秘书兼保镖，忠诚可靠，是为数不多能够真正了解卡帝亚斯想法的男人。原本隶属于地球联邦军谍报部门，是一个谍报专家，为了探寻拉普拉斯之盒秘密的他被卡帝亚斯所拉拢，后逐渐被卡帝亚斯的人格魅力所吸引。工业七号事件之后，起初他为了给卡帝亚斯报仇而联系了葛兰雪要求合作，在接触到巴纳吉・林克斯之后，将卡帝亚斯真正的想法告诉了失落的巴纳吉，让巴纳吉重新振作起来。小说原作最后一章中，贾尔为了掩护巴纳吉回到RX-0独角兽高达上，遭新安洲的步枪直击身亡。而OVA中，贾尔驾驶ARX-014银弹牵制NZ-999新吉翁号，为巴纳吉回到独角兽高达上争取时间，最终机体被新吉翁号打破，幸得巴纳吉所救而获。"
