CaptainDataTemplateLang["地球联邦军所属独立部队ECOAS。军衔中佐。率领自己的920部队与其专用MS LOTO为了阻止&quot;拉普拉斯之箱&quot;外泄而登上了拟亚加玛。作为联邦军的特殊任务部队ECOAS。必须要随时保证自己是其中的一个&quot;零件&quot;而存在着。虽然被别人称呼为&quot;狩猎部队&quot;，也经常不被人正眼所看(ECOAS是专门负责暗地中的黑活的。联邦军内部的军人都知道)。但是他在小说中非常的富有人情味。也曾经安慰失落时候的巴纳吉。"] = "地球联邦军所属独立部队ECOAS。军衔中佐。率领自己的920部队与其专用MS LOTO为了阻止&quot;拉普拉斯之箱&quot;外泄而登上了拟亚加玛。作为联邦军的特殊任务部队ECOAS。必须要随时保证自己是其中的一个&quot;零件&quot;而存在着。虽然被别人称呼为&quot;狩猎部队&quot;，也经常不被人正眼所看(ECOAS是专门负责暗地中的黑活的。联邦军内部的军人都知道)。但是他在小说中非常的富有人情味。也曾经安慰失落时候的巴纳吉。"
