CaptainDataTemplateLang["芙蕾 阿尔斯塔"] = "芙蕾 阿尔斯塔"
CaptainDataTemplateLang["芙蕾是大西洋联邦外务次官乔治・阿尔斯塔的女儿，就读于奥布资源卫星海里奥波利斯工业学校，基拉・大和的同学，未婚夫是塞依・阿格伊尔。因卷入ZAFT军队的袭击事件，芙蕾作为难民而随大天使号逃离。在父亲死后，自愿加入地球联合军。为了复仇，假意接近基拉・大和，想利用基拉为自己战斗。为仇恨迷失的她慢慢醒悟，却在战场上被劳・鲁・克鲁泽击杀，最终也能将自己真正的心意传达给基拉。"] = "芙蕾是大西洋联邦外务次官乔治・阿尔斯塔的女儿，就读于奥布资源卫星海里奥波利斯工业学校，基拉・大和的同学，未婚夫是塞依・阿格伊尔。因卷入ZAFT军队的袭击事件，芙蕾作为难民而随大天使号逃离。在父亲死后，自愿加入地球联合军。为了复仇，假意接近基拉・大和，想利用基拉为自己战斗。为仇恨迷失的她慢慢醒悟，却在战场上被劳・鲁・克鲁泽击杀，最终也能将自己真正的心意传达给基拉。"
