CaptainDataTemplateLang["殖民卫星香格里拉上的少年，与捷多・亚西塔一同经营废品回收工作，曾和捷多合作企图盗走MSZ-006Z高达卖钱，后来却与捷多等人一同登上拟・亚加玛号，并成为奥古成员参与到第一次新吉翁战争中。"] = "殖民卫星香格里拉上的少年，与捷多・亚西塔一同经营废品回收工作，曾和捷多合作企图盗走MSZ-006Z高达卖钱，后来却与捷多等人一同登上拟・亚加玛号，并成为奥古成员参与到第一次新吉翁战争中。"
CaptainDataTemplateLang["沙漠隆美尔"] = "沙漠隆美尔"
CaptainDataTemplateLang["一年战争期间，隆美尔是吉翁军的一名王牌机师，擅长在沙漠地区进行作战。一年战争后，他率领部分吉翁残党在非洲对地球联邦军进行游击作战，并对附近的联邦基地窃取武器装备和各类材料，为吉翁的复兴做准备。U.C.0088年，第一次新吉翁战争爆发，隆美尔和他的军团随即相应，并对以MSZ-010ZZ高达为首的高达小队发起攻击。虽然隆美尔军团的MS明显落后于高达小队，但凭借对沙漠地形的了解依旧给高达小队带来了不小的麻烦。最终由于其沙漠战术被高达小队破解，隆美尔军团遭到全歼，隆美尔本人也在此役阵亡。"] = "一年战争期间，隆美尔是吉翁军的一名王牌机师，擅长在沙漠地区进行作战。一年战争后，他率领部分吉翁残党在非洲对地球联邦军进行游击作战，并对附近的联邦基地窃取武器装备和各类材料，为吉翁的复兴做准备。U.C.0088年，第一次新吉翁战争爆发，隆美尔和他的军团随即相应，并对以MSZ-010ZZ高达为首的高达小队发起攻击。虽然隆美尔军团的MS明显落后于高达小队，但凭借对沙漠地形的了解依旧给高达小队带来了不小的麻烦。最终由于其沙漠战术被高达小队破解，隆美尔军团遭到全歼，隆美尔本人也在此役阵亡。"
CaptainDataTemplateLang["托普"] = "托普"
CaptainDataTemplateLang["没有太多的关于他的背景知。虽然她和她的队友托普戴尔无意造成的麻烦，到底表现得骄傲，这表明他们只是把他们想要的东西的力量。托普要求他停止，威胁他如果不杀他，但Arth的行为最终导致一战开始，托普意识到，村里全是游击队。托普试图反击，却被击落。"] = "没有太多的关于他的背景知。虽然她和她的队友托普戴尔无意造成的麻烦，到底表现得骄傲，这表明他们只是把他们想要的东西的力量。托普要求他停止，威胁他如果不杀他，但Arth的行为最终导致一战开始，托普意识到，村里全是游击队。托普试图反击，却被击落。"
