CaptainDataTemplateLang["由「天人武装组织」的分裂组织成员首领拉古娜・哈维利用「GN 太阳炉」技术造出的「GN-T型太阳炉」所发动的被命名为「GN-X」的机动战士，后来被给于三大群国用来对抗高达的秘密武器。三大群国中每一个联盟都被分派了十台，并组成了一支总机体数为三十的高达歼灭部队（实为二十九架，其中一台「GN-T型太阳炉」引擎由格拉汉姆・艾卡和比利・片桐着手改造「CUSTOM FLAG」）。"] = "由「天人武装组织」的分裂组织成员首领拉古娜・哈维利用「GN 太阳炉」技术造出的「GN-T型太阳炉」所发动的被命名为「GN-X」的机动战士，后来被给于三大群国用来对抗高达的秘密武器。三大群国中每一个联盟都被分派了十台，并组成了一支总机体数为三十的高达歼灭部队（实为二十九架，其中一台「GN-T型太阳炉」引擎由格拉汉姆・艾卡和比利・片桐着手改造「CUSTOM FLAG」）。"
