CaptainDataTemplateLang["自称AEU军的王牌MS驾驶员，于模拟战中取得1999场胜利，因此在AEU驾驶员中认为自己实力过人连带造成其自信过剩的问题，在AEU军方中被归类为问题制造者；在新型机（AEU-09 制定式）公开典礼上（第2000次模拟战）被能天使高达击败，一直怀恨在心。与提耶利亚对战，虽令中性高达重创，但是自己的座机也被击中，座机严重毁坏并往外宇宙漂流，幸亏被驾驶正义女神高达F型的冯恩・史帕克发现并往地球方向踢回。"] = "自称AEU军的王牌MS驾驶员，于模拟战中取得1999场胜利，因此在AEU驾驶员中认为自己实力过人连带造成其自信过剩的问题，在AEU军方中被归类为问题制造者；在新型机（AEU-09 制定式）公开典礼上（第2000次模拟战）被能天使高达击败，一直怀恨在心。与提耶利亚对战，虽令中性高达重创，但是自己的座机也被击中，座机严重毁坏并往外宇宙漂流，幸亏被驾驶正义女神高达F型的冯恩・史帕克发现并往地球方向踢回。"

