local ExplainTemplateLang = {}

ExplainTemplateLang["配件抢夺"] = "配件抢夺"
ExplainTemplateLang["1.19级以上的玩家才能开启配件抢夺玩法。\n2.在配件抢夺中寻宝需要消耗挑战令，每20分钟恢复1个,到达上限不再恢复。\n3.征服战役副本和开启宝箱时有几率得到配件碎片，某个配件的碎片至少有1个时，便可以在配件抢夺中对该配件进行抢夺，战胜其他玩家后有几率获得他们的配件碎片。\n4.配件碎片的数量跟配件品质有关，品质越高的配件需要的配件碎片数量就越多。\n5.未合成的配件碎片有可能会被其他玩家抢夺。\n6.钨钢破甲导弹Ⅰ的合成模板默认为永久开启，即使没有钨钢破甲导弹Ⅰ的碎片仍然可以进行寻宝。\n7.VIP4或角色40级开启配件抢夺寻宝十次功能。\n8.40级开启勋章碎片夺宝功能。"] = "1.19级以上的玩家才能开启配件抢夺玩法。\n2.在配件抢夺中寻宝需要消耗挑战令，每20分钟恢复1个,到达上限不再恢复。\n3.征服战役副本和开启宝箱时有几率得到配件碎片，某个配件的碎片至少有1个时，便可以在配件抢夺中对该配件进行抢夺，战胜其他玩家后有几率获得他们的配件碎片。\n4.配件碎片的数量跟配件品质有关，品质越高的配件需要的配件碎片数量就越多。\n5.未合成的配件碎片有可能会被其他玩家抢夺。\n6.钨钢破甲导弹Ⅰ的合成模板默认为永久开启，即使没有钨钢破甲导弹Ⅰ的碎片仍然可以进行寻宝。\n7.VIP4或角色40级开启配件抢夺寻宝十次功能。\n8.40级开启勋章碎片夺宝功能。"
ExplainTemplateLang["能源保卫战"] = "能源保卫战"
ExplainTemplateLang["1.玩家从第一波开始挑战，只有战斗胜利且满足通关要求时才能进入下一波挑战。\n2.每轮战斗玩家有两次免费挑战次数，挑战失败会扣除一次挑战次数。\n3.玩家每天有两次免费重置次数，重置后可以从第一波开始重新挑战。\n4.玩家可以对已通关的波数进行扫荡，并花费钻石立刻完成扫荡。\n5.VIP5可以跳过战斗。"] = "1.玩家从第一波开始挑战，只有战斗胜利且满足通关要求时才能进入下一波挑战。\n2.每轮战斗玩家有两次免费挑战次数，挑战失败会扣除一次挑战次数。\n3.玩家每天有两次免费重置次数，重置后可以从第一波开始重新挑战。\n4.玩家可以对已通关的波数进行扫荡，并花费钻石立刻完成扫荡。\n5.VIP5可以跳过战斗。"
ExplainTemplateLang["军衔"] = "军衔"
ExplainTemplateLang["1.军衔初始为列兵，升级军衔后可获得特权和每日钻石奖励。\n2.提升军衔需要荣誉达到要求并消耗金币。\n3.荣誉可以在竞技场、配件抢夺、决战月球和宇宙战争等玩法中获得。\n4.军衔等级越高，每日可领取的钻石越多。\n5.军衔特权对各系统的加成影响，在页面中将直接显示军衔加成后的数值。\n6.军衔提升到大元帅之后，荣誉值超过25W的部分可在回收商店购买战备物资。"] = "1.军衔初始为列兵，升级军衔后可获得特权和每日钻石奖励。\n2.提升军衔需要荣誉达到要求并消耗金币。\n3.荣誉可以在竞技场、配件抢夺、决战月球和宇宙战争等玩法中获得。\n4.军衔等级越高，每日可领取的钻石越多。\n5.军衔特权对各系统的加成影响，在页面中将直接显示军衔加成后的数值。\n6.军衔提升到大元帅之后，荣誉值超过25W的部分可在回收商店购买战备物资。"
ExplainTemplateLang["模拟"] = "模拟"
ExplainTemplateLang["1.玩家可对每辆机甲进行模拟，模拟可提升4项基本属性。\n2.模拟消耗模拟训练券和钻石，条件未满足时无法模拟。\n3.模拟增加属性的上限与机甲等级相关，每个属性均有独立的上限值。\n4.模拟时会同时改变4项基本属性的加成效果，每个属性的随机是独立的，每个属性均可能在原基础上增加或减少。\n5.模拟完成后可选择是否保存模拟结果。只有保存模拟结果，模拟所得的加成属性才能生效。\n6.普通模拟只消耗模拟训练券；加强模拟消耗模拟训练券和金币，通过加强模拟更容易获得正数加成值；魔鬼模拟消耗模拟训练券和钻石，通过模拟获得正数加成值的概率比加强模拟更高。"] = "1.玩家可对每辆机甲进行模拟，模拟可提升4项基本属性。\n2.模拟消耗模拟训练券和钻石，条件未满足时无法模拟。\n3.模拟增加属性的上限与机甲等级相关，每个属性均有独立的上限值。\n4.模拟时会同时改变4项基本属性的加成效果，每个属性的随机是独立的，每个属性均可能在原基础上增加或减少。\n5.模拟完成后可选择是否保存模拟结果。只有保存模拟结果，模拟所得的加成属性才能生效。\n6.普通模拟只消耗模拟训练券；加强模拟消耗模拟训练券和金币，通过加强模拟更容易获得正数加成值；魔鬼模拟消耗模拟训练券和钻石，通过模拟获得正数加成值的概率比加强模拟更高。"
ExplainTemplateLang["说明"] = "说明"
ExplainTemplateLang["1.出售：可将机甲和其改造所消耗的机甲以一定比例转换为万能零件，并获得一定比例的资源返还\n2.拆解：可将机甲和其改造所消耗的机甲以全部比例转换为万能零件，并获得全部的资源返还\n3.还原：可将机甲和其改造所消耗的机甲全部还原为初始状态（1级、未改造、未技能升级、未模拟），并获得全部的资源返还\n4.返还的资源包括对该机甲进行升级、改造、技能升级、模拟时所消耗的金币、技能手册、模拟训练券"] = "1.出售：可将机甲和其改造所消耗的机甲以一定比例转换为万能零件，并获得一定比例的资源返还\n2.拆解：可将机甲和其改造所消耗的机甲以全部比例转换为万能零件，并获得全部的资源返还\n3.还原：可将机甲和其改造所消耗的机甲全部还原为初始状态（1级、未改造、未技能升级、未模拟），并获得全部的资源返还\n4.返还的资源包括对该机甲进行升级、改造、技能升级、模拟时所消耗的金币、技能手册、模拟训练券"
ExplainTemplateLang["幸运大翻倍"] = "幸运大翻倍"
ExplainTemplateLang["1.每次翻倍会出现3个图案，每个图案下面有对应的数量。\n2.出现的3个图案各不相同，获得各个图案对应的1倍数量奖励。\n3.出现的3个图案中有2个相同，则获得这2个相同的图案对应的2倍数量奖励和其他图案对应的1倍数量奖励。\n4.出现的3个图案均相同，则获得这3个相同的图案对应的6倍数量奖励。\n5.出现的3个图案均相同，且数量也相同，则获得每个图案对应的30倍数量奖励！！！\n6.普通翻倍1次消耗50钻石，可以获得1点积分，玩家每天会有3次免费的机会。\n7.豪华翻倍1次消耗500钻石，可以获得10点积分。\n8.活动结束后，排行榜上的玩家并且积分达到120分以上，将会获得相应的排名奖励。\n9.积分达到60的玩家还可以领取一份额外的奖励。"] = "1.每次翻倍会出现3个图案，每个图案下面有对应的数量。\n2.出现的3个图案各不相同，获得各个图案对应的1倍数量奖励。\n3.出现的3个图案中有2个相同，则获得这2个相同的图案对应的2倍数量奖励和其他图案对应的1倍数量奖励。\n4.出现的3个图案均相同，则获得这3个相同的图案对应的6倍数量奖励。\n5.出现的3个图案均相同，且数量也相同，则获得每个图案对应的30倍数量奖励！！！\n6.普通翻倍1次消耗50钻石，可以获得1点积分，玩家每天会有3次免费的机会。\n7.豪华翻倍1次消耗500钻石，可以获得10点积分。\n8.活动结束后，排行榜上的玩家并且积分达到120分以上，将会获得相应的排名奖励。\n9.积分达到60的玩家还可以领取一份额外的奖励。"
ExplainTemplateLang["图鉴"] = "图鉴"
ExplainTemplateLang["1.首次获得机甲/机师/勋章后可以激活该机甲/机师/勋章的图鉴，同时获得对应的属性加成。\n2.激活的品质越高，获得的属性加成越好。\n3.激活图鉴获得的属性对所有出战机甲生效。\n4.重复获得同样的机甲/机师/勋章，增加的属性不会累积。"] = "1.首次获得机甲/机师/勋章后可以激活该机甲/机师/勋章的图鉴，同时获得对应的属性加成。\n2.激活的品质越高，获得的属性加成越好。\n3.激活图鉴获得的属性对所有出战机甲生效。\n4.重复获得同样的机甲/机师/勋章，增加的属性不会累积。"
ExplainTemplateLang["勋章"] = "勋章"
ExplainTemplateLang["1.40级时，每辆机甲开启2个勋章孔位，之后每提升10级开启1个。\n2.每辆机甲最多可以装备6个勋章，勋章增加的属性只对该机甲生效。\n3.每辆机甲上装备的6个勋章类型不能重复。\n4.一共有5个战役可以进行征战，品质从低到高分别是鲁姆海战、维多利亚港战役、星一号作战、拉米昂作战、奥布战役。\n5.征战鲁姆海战可以获得白色和绿色品质的勋章；征战维多利亚港战役可以获得白色、绿色和蓝色品质的勋章；征战星一号作战可以获得绿色和蓝色品质的勋章；征战拉米昂作战可以获得蓝色和紫色品质的勋章；征战奥布战役可以获得紫色和橙色品质的勋章。\n6.征战需要消耗军费金币，并且有一定的几率将当前战役升级为更高品质。\n7.高级征战需要消耗钻石或者征战许可，可以将当前战役直接升级到拉米昂作战，并会额外赠送一个银质经验勋章。\n8.勋章可以吞噬除橙色和紫色之外的勋章来升级，不同品质、等级的勋章提供的经验不同。升级后的勋章被吞噬时，经验不会损耗。\n9.玩家每提升10级，勋章的等级上限提升5级。\n10.VIP5级开启快速征战10次功能。\n11.VIP6级开启快速征战50次功能，花费为原价的90%。\n12.VIP10级开启快速征战500次功能，花费为原价的90%。\n13.拥有100万金币可以使用高级征战10次。\n14.VIP9级开启高级征战50次功能，花费为原价的90%。拥有450万金币可以使用高级征战50次。\n15.花费征战点可以改造勋章，提升属性。勋章最多可以改造10级。改造过的勋章无法作为升级所需的消耗材料。\n16.橙色和紫色勋章可以被出售，出售得到的征战点可以用于改造勋章。\n17.消耗钻石可以使用勋章还原功能，还原会将勋章变为初始形态同时返还改造及升级所消耗的全部经验和征战点。\n18.升级或改造并且未装备的勋章才会显示在还原界面中。"] = "1.40级时，每辆机甲开启2个勋章孔位，之后每提升10级开启1个。\n2.每辆机甲最多可以装备6个勋章，勋章增加的属性只对该机甲生效。\n3.每辆机甲上装备的6个勋章类型不能重复。\n4.一共有5个战役可以进行征战，品质从低到高分别是鲁姆海战、维多利亚港战役、星一号作战、拉米昂作战、奥布战役。\n5.征战鲁姆海战可以获得白色和绿色品质的勋章；征战维多利亚港战役可以获得白色、绿色和蓝色品质的勋章；征战星一号作战可以获得绿色和蓝色品质的勋章；征战拉米昂作战可以获得蓝色和紫色品质的勋章；征战奥布战役可以获得紫色和橙色品质的勋章。\n6.征战需要消耗军费金币，并且有一定的几率将当前战役升级为更高品质。\n7.高级征战需要消耗钻石或者征战许可，可以将当前战役直接升级到拉米昂作战，并会额外赠送一个银质经验勋章。\n8.勋章可以吞噬除橙色和紫色之外的勋章来升级，不同品质、等级的勋章提供的经验不同。升级后的勋章被吞噬时，经验不会损耗。\n9.玩家每提升10级，勋章的等级上限提升5级。\n10.VIP5级开启快速征战10次功能。\n11.VIP6级开启快速征战50次功能，花费为原价的90%。\n12.VIP10级开启快速征战500次功能，花费为原价的90%。\n13.拥有100万金币可以使用高级征战10次。\n14.VIP9级开启高级征战50次功能，花费为原价的90%。拥有450万金币可以使用高级征战50次。\n15.花费征战点可以改造勋章，提升属性。勋章最多可以改造10级。改造过的勋章无法作为升级所需的消耗材料。\n16.橙色和紫色勋章可以被出售，出售得到的征战点可以用于改造勋章。\n17.消耗钻石可以使用勋章还原功能，还原会将勋章变为初始形态同时返还改造及升级所消耗的全部经验和征战点。\n18.升级或改造并且未装备的勋章才会显示在还原界面中。"
ExplainTemplateLang["勋章改造"] = "勋章改造"
ExplainTemplateLang["1.花费征战点可以改造勋章，提升属性。\n2.分解紫色和橙色勋章可以获得征战点。\n3.勋章最多可以改造10级。"] = "1.花费征战点可以改造勋章，提升属性。\n2.分解紫色和橙色勋章可以获得征战点。\n3.勋章最多可以改造10级。"
ExplainTemplateLang["勋章出售"] = "勋章出售"
ExplainTemplateLang["1.橙色和紫色勋章可以被出售。\n2.出售可以得到征战点和返还部分升级消耗的经验。\n3.出售所得的征战点，包含勋章基础征战点和部分改造消耗的征战点。"] = "1.橙色和紫色勋章可以被出售。\n2.出售可以得到征战点和返还部分升级消耗的经验。\n3.出售所得的征战点，包含勋章基础征战点和部分改造消耗的征战点。"
ExplainTemplateLang["勋章还原"] = "勋章还原"
ExplainTemplateLang["1.消耗钻石可以使用勋章还原功能，还原会将勋章变为初始形态同时返还改造及升级所消耗的全部经验和征战点。\n2.升级或改造并且未装备的勋章才会显示在还原界面中。"] = "1.消耗钻石可以使用勋章还原功能，还原会将勋章变为初始形态同时返还改造及升级所消耗的全部经验和征战点。\n2.升级或改造并且未装备的勋章才会显示在还原界面中。"
ExplainTemplateLang["勇气争锋"] = "勇气争锋"
ExplainTemplateLang["1.每天12:00开启勇气争锋，12:40决出冠军并发放奖励\n\n2.选拔赛阶段，每次消耗一定金币进行参赛或挑战\n\n3.选拔赛结束后，在参赛席位上的玩家进入32强，之后按照赛程由系统安排自动进行战斗\n\n4.对决开始后，按照玩家当前的阵容进行战斗(每轮晋级赛倒计时结束前，可以更换阵容)\n\n5.决出4强后，玩家可以选择支持4强选手中的1位，若支持的玩家获得冠军，玩家可获得更丰富的竞猜奖励\n\n6.决出冠军后，系统会在所有参与活动的玩家(包括未进32强的玩家)中选出一名幸运玩家，发放一份幸运奖励\n\n7.32强奖励由基础奖励和奖池奖励组成，基础奖励参见奖励预览\n\n8.奖池奖励由玩家参赛、挑战或支持所消耗的金币累计而成，每届剩余的奖池奖励会累计至下届，玩家分得奖池奖励的比例如下：\n  冠军奖励：12%\n  亚军奖励：8%\n  4强奖励：6%\n  8强奖励：4%\n  16强奖励：2%\n  32强奖励：1%\n\n9.冠军连任次数越多，可获得奖池奖励比例越高，最高比例为32%；终结连任次数越多的冠军，可获得奖池奖励比例越高，最高比例为32%\n\n10.冠军玩家参加下届勇气争锋时，技能伤害降低10%，持续连冠，最多降低50%"] = "1.每天12:00开启勇气争锋，12:40决出冠军并发放奖励\n\n2.选拔赛阶段，每次消耗一定金币进行参赛或挑战\n\n3.选拔赛结束后，在参赛席位上的玩家进入32强，之后按照赛程由系统安排自动进行战斗\n\n4.对决开始后，按照玩家当前的阵容进行战斗(每轮晋级赛倒计时结束前，可以更换阵容)\n\n5.决出4强后，玩家可以选择支持4强选手中的1位，若支持的玩家获得冠军，玩家可获得更丰富的竞猜奖励\n\n6.决出冠军后，系统会在所有参与活动的玩家(包括未进32强的玩家)中选出一名幸运玩家，发放一份幸运奖励\n\n7.32强奖励由基础奖励和奖池奖励组成，基础奖励参见奖励预览\n\n8.奖池奖励由玩家参赛、挑战或支持所消耗的金币累计而成，每届剩余的奖池奖励会累计至下届，玩家分得奖池奖励的比例如下：\n  冠军奖励：12%\n  亚军奖励：8%\n  4强奖励：6%\n  8强奖励：4%\n  16强奖励：2%\n  32强奖励：1%\n\n9.冠军连任次数越多，可获得奖池奖励比例越高，最高比例为32%；终结连任次数越多的冠军，可获得奖池奖励比例越高，最高比例为32%\n\n10.冠军玩家参加下届勇气争锋时，技能伤害降低10%，持续连冠，最多降低50%"
ExplainTemplateLang["军团"] = "军团"
ExplainTemplateLang["1.玩家达到18级后可加入本阵营的军团，也可花费5000钻石创建军团\n\n2.玩家加入军团后可查看军团内的成员信息、与成员聊天\n\n3.玩家加入军团后，捐献军费可以增加军团建设和个人贡献\n\n(1)军团建设用于升级军团和军团科技\n(2)个人贡献用于兑换军团商城的道具\n\n4.副军团长和军团成员的数量上限会随着军团等级的提升而提升，副军团长数量上限如下：\n\n1级军团：2名\n10级军团：3名\n20级以上军团：4名\n\n5.军团长和副军团长拥有审核成员、修改宣言、修改公告、升级军团和升级军团科技等特权\n\n6.军团长拥有修改军团徽章和解散军团等权限\n\n7.军团长7天未登录游戏，军团长一职将会自动转让给其他成员\n\n8.玩家退出军团个人贡献依然保留，3小时冷却时间后才可再加入新军团\n\n9.军团5级开启军团BOSS挑战，军团成员共同挑战军团BOSS，击败后能够根据伤害排名获得丰厚奖励"] = "1.玩家达到18级后可加入本阵营的军团，也可花费5000钻石创建军团\n\n2.玩家加入军团后可查看军团内的成员信息、与成员聊天\n\n3.玩家加入军团后，捐献军费可以增加军团建设和个人贡献\n\n(1)军团建设用于升级军团和军团科技\n(2)个人贡献用于兑换军团商城的道具\n\n4.副军团长和军团成员的数量上限会随着军团等级的提升而提升，副军团长数量上限如下：\n\n1级军团：2名\n10级军团：3名\n20级以上军团：4名\n\n5.军团长和副军团长拥有审核成员、修改宣言、修改公告、升级军团和升级军团科技等特权\n\n6.军团长拥有修改军团徽章和解散军团等权限\n\n7.军团长7天未登录游戏，军团长一职将会自动转让给其他成员\n\n8.玩家退出军团个人贡献依然保留，3小时冷却时间后才可再加入新军团\n\n9.军团5级开启军团BOSS挑战，军团成员共同挑战军团BOSS，击败后能够根据伤害排名获得丰厚奖励"
ExplainTemplateLang["让红包飞"] = "让红包飞"
ExplainTemplateLang["1.活动一共开启8天，前4天玩家消耗的钻石和金币将会在后4天返还%s。\n2.第1天消耗的钻石和金币将会在第5天领取返还；第2天消耗的钻石和金币将会在第6天领取返还；第3天消耗的钻石和金币将会在第7天领取返还；第4天消耗的钻石和金币将会在第8天领取返还。\n3.每天可领取返还金币的上限为%s，钻石无上限。\n4.若当日不领取返还的钻石和金币，则次日不可领取。"] = "1.活动一共开启8天，前4天玩家消耗的钻石和金币将会在后4天返还%s。\n2.第1天消耗的钻石和金币将会在第5天领取返还；第2天消耗的钻石和金币将会在第6天领取返还；第3天消耗的钻石和金币将会在第7天领取返还；第4天消耗的钻石和金币将会在第8天领取返还。\n3.每天可领取返还金币的上限为%s，钻石无上限。\n4.若当日不领取返还的钻石和金币，则次日不可领取。"
ExplainTemplateLang["决战月球"] = "决战月球"
ExplainTemplateLang["1.参与等级与开启时间\n角色等级达到25级可参加决战月球。\n周二、周五、周日的20:30-20:50开启决战月球。\n\n2.星球争夺\n活动开启后，吉翁、联邦、宇宙的玩家从各自阵营的大本营出发。\n占领欧洲战场中的中立星球或其他阵营星球，被占领的星球会归属于自己的阵营。\n所有的战斗都是围绕攻击或防守星球而进行。\n玩家可以攻击自己相邻的其他阵营星球。\n击败星球内的所有驻军即可占领该星球。\n占领星球后，己方阵营的玩家可以向该星球驻军。\n决战月球期间，星球会为所属阵营产出战略资源。\n决战月球结束时，将根据战略资源进行阵营排名。\n\n3.星球产出\n除大本营之外的星球，每隔15秒为所属阵营产出一定数量的战略资源。\n决战月球结束时，会依据3个阵营的战略资源量进行阵营排名，前2名的阵营会获得额外奖励。\n在所有星球中，星球1待定产出资源最快，与大本营相连的3个星球产出最慢。\n决战月球结束时，占领星球1待定的阵营每个参战玩家还可以额外领取一次推进剂奖励。\战斗最后5分钟，所有地点的资源产出速度都将翻倍。\n\n4.个人战斗\n4.1战功\n玩家每次主动发起进攻，都能够获得一定数量战功。\n前5次进攻可以获得大量额外战功。\n击杀对手可以获得2倍战功。\n被攻击不会获得任何战功。\n4.2士气\n参加决战月球的玩家，每人默认拥有100点士气。\n战斗会消耗一定数量士气。\n士气不能随时间回复，也不能以任何方式获得或购买。\n当士气为0的时候，玩家被击败，然后自动返回大本营进行休整。\n休整后可以重新开始战斗并且士气回满。\n玩家不能主动返回大本营。\n无法攻击大本营内的敌人。\n受到大本营内的敌人攻击会额外-2士气。\n大本营相连的3个星球为基地，和基地内的敌人作战会额外-1士气。\n4.3主力部队\n决战月球中每隔一段时间每个阵营会刷新出自己的主力部队。\n击杀敌对阵营的主力部队可以额外获得1000点战功奖励。\n4.4开启侦察\n开启侦察后，会在15秒内显示所有星球内的人数。\n4.5破釜沉舟\n使用破釜沉舟会消耗玩家20点士气。\进入破釜沉舟状态后发起进攻时双方基础士气损失翻倍（不包括星球和军衔加成的部分）。\n破釜沉舟状态会在进攻10次或者被击杀后消失。\n\n5.奖励\n决战月球的奖励包括6部分。\n(1)阵营排名金币奖励\n阵营排名前2名的阵营，能够获得该奖励；\n名次越靠前，奖励越多；\n(2)阵营连胜金币奖励\n当阵营取得连胜后，阵营的全体参战玩家都将获得该奖励；\n连胜次数越多，该项奖励越多；\n(3)阵营占领星球1待定推进剂奖励\n决战月球结束时，占领星球1待定的阵营全体参战玩家都将获得该奖励\n奖励为30点推进剂；\n(4)战功金币奖励\n玩家所得战功越多，该项奖励越多；\n(5)战功排名金币奖励\n玩家在本阵营的战功排名越高，该项奖励越多；\n(6)战功排名声望奖励\n玩家在本阵营的战功排名越高，该项奖励越多；\n如果在决战月球中战功不为0，结束后就能获得声望奖励。\n战功排名对应声望\n第1名 200声望\n第2名 180声望 \n第3名 170声望\n第4名 160声望\n第5名 150望\n第6-10名 140声望\n第11-20名 130声望\n第21-50名 120声望\n第51-80名 110声望\n第81-120名 100声望\n第121-200名 90声望\n第201-300名 80声望\n第301-400名 70声望\n第401-500名 60声望\n第500名后50声望\n\n6.连胜\n连续排名第1超过2次的阵营会进入连胜状态。\n连胜阵营的玩家会有额外的金币加成和技能伤害惩罚。\n在决战月球中同一阵营连胜的次数越多，该阵营的玩家金币加成越高，造成的技能伤害越低。\n金币加成最多100%，技能伤害降低最多50%。\n\n7.每次决战月球结束后会确定下次活动的系列随机效果，对应系列机甲将获得随机的战斗加成。\n\n8.托管说明：\n（1）VIP4及以上玩家可在决战月球中使用托管功能。\n（2）托管可以使玩家在决战月球中按照系统预设路线进行自动移动和战斗，无需操作。\n（3）在决战月球当天20:50之前的任意时间都可以设置托管。\n（4）在战斗结束之前可以随时切换托管状态。\n（5）如果进行托管，战功的获得会有一定损失。建议对战功有追求的玩家选择手动战斗！"] = "1.参与等级与开启时间\n角色等级达到25级可参加决战月球。\n周二、周五、周日的20:30-20:50开启决战月球。\n\n2.星球争夺\n活动开启后，吉翁、联邦、宇宙的玩家从各自阵营的大本营出发。\n占领欧洲战场中的中立星球或其他阵营星球，被占领的星球会归属于自己的阵营