ExplainTemplateLang["铁甲兵工厂"] = "铁甲兵工厂"
ExplainTemplateLang["1.活动期间，玩家通关普通或精英战役可获得低级物资，捐献低级物资可获得一个奖励\n2.使用钻石可直接捐献高级物资获得1个或5个奖励\n3.获得的奖励将直接放入仓库内\n4.排行榜奖励需要积分达到850分以上才可获得\n5.积分奖励当积分达到450分便可立即获得"] = "1.活动期间，玩家通关普通或精英战役可获得低级物资，捐献低级物资可获得一个奖励\n2.使用钻石可直接捐献高级物资获得1个或5个奖励\n3.获得的奖励将直接放入仓库内\n4.排行榜奖励需要积分达到850分以上才可获得\n5.积分奖励当积分达到450分便可立即获得"
ExplainTemplateLang["配件还原"] = "配件还原"
ExplainTemplateLang["1.配件还原消耗50钻石，使所选配件变为初始形态同时返还升级和改造所消耗的全部金币和科技点。\n2.升级或改造过的配件在未被装备的情况下可以进行还原。"] = "1.配件还原消耗50钻石，使所选配件变为初始形态同时返还升级和改造所消耗的全部金币和科技点。\n2.升级或改造过的配件在未被装备的情况下可以进行还原。"
ExplainTemplateLang["勋章装备"] = "勋章装备"
ExplainTemplateLang["1.每辆机甲上装备的6个勋章类型不能重复。\n2.系统已自动帮您筛选掉无法装备的勋章，即类型重复的勋章。\n3.点击下排选择框可快速筛选出特定类型的勋章。\n4.列表按照勋章的品质、改造等级、等级依次进行排序。"] = "1.每辆机甲上装备的6个勋章类型不能重复。\n2.系统已自动帮您筛选掉无法装备的勋章，即类型重复的勋章。\n3.点击下排选择框可快速筛选出特定类型的勋章。\n4.列表按照勋章的品质、改造等级、等级依次进行排序。"
ExplainTemplateLang["勋章升级"] = "勋章升级"
ExplainTemplateLang["1.紫色和橙色勋章不能作为升级材料。\n2.改造过的勋章不能作为升级材料。\n3.暴击伤害类型的勋章最高只能升到50级。\n4.VIP5开启快速选择功能：根据提升等级数，自动选取足够经验的勋章。"] = "1.紫色和橙色勋章不能作为升级材料。\n2.改造过的勋章不能作为升级材料。\n3.暴击伤害类型的勋章最高只能升到50级。\n4.VIP5开启快速选择功能：根据提升等级数，自动选取足够经验的勋章。"
ExplainTemplateLang["答题"] = "答题"
ExplainTemplateLang["1.答题越快，分数越高；等级越高，金币奖励越多。\n2.选择答案后将无法修改，请谨慎选择。\n3.分数奖励将在完成答题后通过领奖中心发放。\n4.排行榜前十名奖励将在每日23:00通过领奖中心发放。"] = "1.答题越快，分数越高；等级越高，金币奖励越多。\n2.选择答案后将无法修改，请谨慎选择。\n3.分数奖励将在完成答题后通过领奖中心发放。\n4.排行榜前十名奖励将在每日23:00通过领奖中心发放。"
ExplainTemplateLang["金币探索"] = "金币探索"
ExplainTemplateLang["1.玩家可以开采一个矿持续生产金币，开采结束后在开采界面内领取金币奖励。\n2.开采时间为8小时，花费20钻石可以延长4小时开采时间，每次开采最多可延长4次。\n3.开采1小时后可以撤离，但只能获得部分已开采的金币。\n4.可以邀请同军团的成员协助守矿。协助者在协助守矿时可以增加开采速度，协助者战斗力越高，开采速度加成越多。开采完毕后协助者将获得额外金币奖励。每天最多能够协助其他玩家4次。\n5.抢夺其他玩家的矿能够获得该矿部分已开采的金币。自己正在开采的矿也会被抢夺，每个矿最多被抢夺4次。每日最多可以抢夺15次（抢夺失败不算次数）。\n6.每次开采消耗2个探索令，抢夺消耗3个探索令（抢夺时如果对方有协助者，攻打协助者消耗1个探索令，攻打占矿者消耗2个）。探索令每45分钟恢复1个，拥有上限为20个。\n7.每次搜索抢夺对象需要消耗金币，消耗数量会随搜索次数增多，次日重置。"] = "1.玩家可以开采一个矿持续生产金币，开采结束后在开采界面内领取金币奖励。\n2.开采时间为8小时，花费20钻石可以延长4小时开采时间，每次开采最多可延长4次。\n3.开采1小时后可以撤离，但只能获得部分已开采的金币。\n4.可以邀请同军团的成员协助守矿。协助者在协助守矿时可以增加开采速度，协助者战斗力越高，开采速度加成越多。开采完毕后协助者将获得额外金币奖励。每天最多能够协助其他玩家4次。\n5.抢夺其他玩家的矿能够获得该矿部分已开采的金币。自己正在开采的矿也会被抢夺，每个矿最多被抢夺4次。每日最多可以抢夺15次（抢夺失败不算次数）。\n6.每次开采消耗2个探索令，抢夺消耗3个探索令（抢夺时如果对方有协助者，攻打协助者消耗1个探索令，攻打占矿者消耗2个）。探索令每45分钟恢复1个，拥有上限为20个。\n7.每次搜索抢夺对象需要消耗金币，消耗数量会随搜索次数增多，次日重置。"
ExplainTemplateLang["宝藏兑换"] = "宝藏兑换"
ExplainTemplateLang["1.在活动期间，挑战战役有机率掉落面包、巧克力、烈酒、药品这4种道具。\n2.参与许愿树活动有机率获得%s。\n3.不同数量的5种道具组合在一起可以兑换宝藏大礼。\n4.活动结束后，5种道具不会清零，在下次活动开启后仍可以用来进行兑换。"] = "1.在活动期间，挑战战役有机率掉落面包、巧克力、烈酒、药品这4种道具。\n2.参与许愿树活动有机率获得%s。\n3.不同数量的5种道具组合在一起可以兑换宝藏大礼。\n4.活动结束后，5种道具不会清零，在下次活动开启后仍可以用来进行兑换。"
ExplainTemplateLang["宇宙战争"] = "宇宙战争"
ExplainTemplateLang["1.角色达到40级可参加宇宙战争，该活动为“决战月球”战火蔓延到全服后的模式，同平台内所有服务器的玩家都将在一起进行竞技！\n2.系统会依据角色等级将玩家分配至对应等级段的战场进行战斗，等级相近的玩家会在相同等级段的战场进行竞技。\n3.战场等级越高，奖励越丰富，每个战场都有独立的战功排行榜奖励。\n4.为保证玩法的平衡性，每次宇宙战争开启后，参战的玩家将被随机分配到联邦、宇宙、吉翁阵营中的一个，战场中的随机阵营与玩家实际阵营互不影响，随机阵营仅在本次宇宙战争活动中生效(如：一个吉翁阵营玩家，进入宇宙战争战场后，被随机分配到宇宙阵营，玩家仅在这次宇宙战争内属于宇宙阵营，离开战场或活动结束后，玩家仍属于吉翁阵营)\n5.“宇宙战争”与“决战月球”相比的差异主要包括：\n(1)玩家的初始士气上限由100点改为60点；\n(2)玩家死亡后可消耗钻石清除复活CD；\n(3)最终占领耶路撒冷的阵营推进剂奖励提升到50点；\n(4)战功排名不再区分阵营；\n(5)取消了阵营连胜效果；\n(6)战斗荣誉奖励将在活动结束后通过领奖中心发放；\n(7)VIP8及以上玩家可在宇宙战争中使用托管功能。"] = "1.角色达到40级可参加宇宙战争，该活动为“决战月球”战火蔓延到全服后的模式，同平台内所有服务器的玩家都将在一起进行竞技！\n2.系统会依据角色等级将玩家分配至对应等级段的战场进行战斗，等级相近的玩家会在相同等级段的战场进行竞技。\n3.战场等级越高，奖励越丰富，每个战场都有独立的战功排行榜奖励。\n4.为保证玩法的平衡性，每次宇宙战争开启后，参战的玩家将被随机分配到联邦、宇宙、吉翁阵营中的一个，战场中的随机阵营与玩家实际阵营互不影响，随机阵营仅在本次宇宙战争活动中生效(如：一个吉翁阵营玩家，进入宇宙战争战场后，被随机分配到宇宙阵营，玩家仅在这次宇宙战争内属于宇宙阵营，离开战场或活动结束后，玩家仍属于吉翁阵营)\n5.“宇宙战争”与“决战月球”相比的差异主要包括：\n(1)玩家的初始士气上限由100点改为60点；\n(2)玩家死亡后可消耗钻石清除复活CD；\n(3)最终占领耶路撒冷的阵营推进剂奖励提升到50点；\n(4)战功排名不再区分阵营；\n(5)取消了阵营连胜效果；\n(6)战斗荣誉奖励将在活动结束后通过领奖中心发放；\n(7)VIP8及以上玩家可在宇宙战争中使用托管功能。"
ExplainTemplateLang["军备竞赛"] = "军备竞赛"
ExplainTemplateLang["1.活动时间\n战斗力竞赛从服务器开启持续到第7天24点；\n普通战役的战役星竞赛从服务器开启持续到第3天24点；\n竞技场排名竞赛从第4天0点持续到第6天24点。\n2.奖励组成\n军备竞赛的奖励分为排名奖励和积分奖励。\n3.排名奖励\n(1)活动截止时，排名前10的玩家可以获得排名奖励；\n(2)排名奖励在每一项竞赛结束后立即通过领奖中心发放\n(3)请注意！\n在每一项竞赛中，如果有玩家的战斗力、普通战役的战役星数量或竞技场排名相同，则先达到该数值的玩家将排名靠前；\n4.积分奖励\n(1)每种竞赛的积分奖励都有3档；\n(2)达到条件可以立即领取奖励；\n请各位玩家在竞赛结束前领取你的积分奖励！"] = "1.活动时间\n战斗力竞赛从服务器开启持续到第7天24点；\n普通战役的战役星竞赛从服务器开启持续到第3天24点；\n竞技场排名竞赛从第4天0点持续到第6天24点。\n2.奖励组成\n军备竞赛的奖励分为排名奖励和积分奖励。\n3.排名奖励\n(1)活动截止时，排名前10的玩家可以获得排名奖励；\n(2)排名奖励在每一项竞赛结束后立即通过领奖中心发放\n(3)请注意！\n在每一项竞赛中，如果有玩家的战斗力、普通战役的战役星数量或竞技场排名相同，则先达到该数值的玩家将排名靠前；\n4.积分奖励\n(1)每种竞赛的积分奖励都有3档；\n(2)达到条件可以立即领取奖励；\n请各位玩家在竞赛结束前领取你的积分奖励！"
ExplainTemplateLang["最强机体"] = "最强机体"
ExplainTemplateLang["1.玩家每天21:00可以开始对最强机体机甲终极机甲发起挑战，终极机甲拥有超高的血量和攻击，需要本服玩家共同配合才能击杀。\n2.15分钟内击败终极机甲即挑战成功。能够根据伤害排名获得对应奖励。对终极机甲造成最后一击的玩家还能够额外获得一份击杀奖励。挑战时间结束终极机甲未被击杀将无法获得排名奖励。\n3.终极机甲的生命值会随上一次被击杀时的剩余时间变动。未被击杀时下次生命值会降低。\n4.玩家每次战斗能够获得金币奖励，造成伤害越多，获得金币越多。\n5.火力强化可以提升出战机甲的技能伤害加成，仅对本次挑战生效。\n6.每次挑战会有随机一种类型的机甲获得技能伤害加成。\n7.VIP7或90级以上玩家可以在挑战开始前开启托管，下次挑战将自动和终极机甲进行战斗。挑战过程中也可以随时切换托管状态。"] = "1.玩家每天21:00可以开始对最强机体机甲终极机甲发起挑战，终极机甲拥有超高的血量和攻击，需要本服玩家共同配合才能击杀。\n2.15分钟内击败终极机甲即挑战成功。能够根据伤害排名获得对应奖励。对终极机甲造成最后一击的玩家还能够额外获得一份击杀奖励。挑战时间结束终极机甲未被击杀将无法获得排名奖励。\n3.终极机甲的生命值会随上一次被击杀时的剩余时间变动。未被击杀时下次生命值会降低。\n4.玩家每次战斗能够获得金币奖励，造成伤害越多，获得金币越多。\n5.火力强化可以提升出战机甲的技能伤害加成，仅对本次挑战生效。\n6.每次挑战会有随机一种类型的机甲获得技能伤害加成。\n7.VIP7或90级以上玩家可以在挑战开始前开启托管，下次挑战将自动和终极机甲进行战斗。挑战过程中也可以随时切换托管状态。"
ExplainTemplateLang["工程"] = "工程"
ExplainTemplateLang["1.35级开启工程功能。\n2.通过激活和升级相应的工程领域，可以获得属性加成。\n3.激活和升级消耗金币及工程图纸。\n4.工程图纸可以在竞技场通过勇气兑换获得，可以在配件抢夺中通过抢夺获得，也在最强机体中产出。"] = "1.35级开启工程功能。\n2.通过激活和升级相应的工程领域，可以获得属性加成。\n3.激活和升级消耗金币及工程图纸。\n4.工程图纸可以在竞技场通过勇气兑换获得，可以在配件抢夺中通过抢夺获得，也在最强机体中产出。"
ExplainTemplateLang["战友招募"] = "战友招募"
ExplainTemplateLang["1.每个帐号仅有一次绑定邀请码的机会，当游戏帐号绑定邀请码后，该帐号下所有不同区的角色将无法再绑定其他邀请码，绑定邀请码后可以在领奖中心领取一份豪华奖励。\n2.您可以在“个人头像-设置-验证邀请”中输入并绑定邀请码，不能绑定自己及同一账号下其他角色的邀请码。\n3.应用宝与其他国内平台的帐号相互独立。即应用宝平台的游戏帐号只能绑定来自应用宝其他帐号分享的邀请码；应用宝平台的游戏帐号分享的邀请码也只能在应用宝平台的账号进行绑定。\n4.玩家20级后可以获得自己的邀请码，将自己的邀请码进行分享，每位成功绑定了您的邀请码的其他玩家，将为您的帐号提供3点积分。\n5.被邀请者从绑定邀请码的当日开始连续登陆2、3、4、5、\n6、7日将为您的帐号分别提供2、3、4、5、6、7点积分，即每位被邀请者最多为您的帐号提供30点积分。\n6.积分达到一定档位时可以在战友招募界面领取相应档位的奖励，领取奖励不会扣除积分。\n7.玩家在某区领取了某档位的积分奖励后，在该账号下所有不同区角色将无法领取该档位的奖励。一个帐号下拥有多个不同区角色的玩家请慎重选择。"] = "1.每个帐号仅有一次绑定邀请码的机会，当游戏帐号绑定邀请码后，该帐号下所有不同区的角色将无法再绑定其他邀请码，绑定邀请码后可以在领奖中心领取一份豪华奖励。\n2.您可以在“个人头像-设置-验证邀请”中输入并绑定邀请码，不能绑定自己及同一账号下其他角色的邀请码。\n3.应用宝与其他国内平台的帐号相互独立。即应用宝平台的游戏帐号只能绑定来自应用宝其他帐号分享的邀请码；应用宝平台的游戏帐号分享的邀请码也只能在应用宝平台的账号进行绑定。\n4.玩家20级后可以获得自己的邀请码，将自己的邀请码进行分享，每位成功绑定了您的邀请码的其他玩家，将为您的帐号提供3点积分。\n5.被邀请者从绑定邀请码的当日开始连续登陆2、3、4、5、\n6、7日将为您的帐号分别提供2、3、4、5、6、7点积分，即每位被邀请者最多为您的帐号提供30点积分。\n6.积分达到一定档位时可以在战友招募界面领取相应档位的奖励，领取奖励不会扣除积分。\n7.玩家在某区领取了某档位的积分奖励后，在该账号下所有不同区角色将无法领取该档位的奖励。一个帐号下拥有多个不同区角色的玩家请慎重选择。"
ExplainTemplateLang["机师"] = "机师"
ExplainTemplateLang["1.50级开启机师功能。\n2.每辆机甲只能任命一位机师进行指挥。机师增加的属性只对该机甲生效。\n3.机师有基础属性、特长属性和晋升属性。\n4.机师等级不能超过角色等级。\n5.机师的特长属性有2条，分别对应国籍与机甲类型。特长属性在机师等级达到40级和80级时先后解锁。解锁后，还需要把机师任命给对应系列、对应类型的机甲，才能使特长属性匹配生效。\n6.机师的晋升属性，在机师晋升后可以获得。紫色橙色品质的机师在晋升到中将和上将后，还能大幅提升某些机甲技能的效果。请在机师任命时注意！挑选在特长属性和晋升属性两方面都与机甲匹配的机师，能够发挥其最大价值。\n7.玩家可以在机师详细界面中对其进行锁定或解锁的操作。锁定后的机师，不能解雇、高级解雇和退役。\n8.当玩家未拥有某机师，但是拥有该机师的碎片时，可以通过专属合成获得该机师。当玩家已拥有某机师，并再次招募到该机师时，将会转化为相应的碎片数量，并增加到机师的军衔进度中。"] = "1.50级开启机师功能。\n2.每辆机甲只能任命一位机师进行指挥。机师增加的属性只对该机甲生效。\n3.机师有基础属性、特长属性和晋升属性。\n4.机师等级不能超过角色等级。\n5.机师的特长属性有2条，分别对应国籍与机甲类型。特长属性在机师等级达到40级和80级时先后解锁。解锁后，还需要把机师任命给对应系列、对应类型的机甲，才能使特长属性匹配生效。\n6.机师的晋升属性，在机师晋升后可以获得。紫色橙色品质的机师在晋升到中将和上将后，还能大幅提升某些机甲技能的效果。请在机师任命时注意！挑选在特长属性和晋升属性两方面都与机甲匹配的机师，能够发挥其最大价值。\n7.玩家可以在机师详细界面中对其进行锁定或解锁的操作。锁定后的机师，不能解雇、高级解雇和退役。\n8.当玩家未拥有某机师，但是拥有该机师的碎片时，可以通过专属合成获得该机师。当玩家已拥有某机师，并再次招募到该机师时，将会转化为相应的碎片数量，并增加到机师的军衔进度中。"
ExplainTemplateLang["机师合成"] = "机师合成"
ExplainTemplateLang["1.当玩家未拥有某机师，但是拥有该机师的碎片时，可以通过专属合成获得该机师。\n2.当玩家已拥有某机师，并再次招募到该机师时，将会转化为相应的碎片数量，并增加到机师的军衔进度中。\n3.普通机师信物可用于兑换紫色品质机师，高级机师信物可用于兑换橙色品质机师。"] = "1.当玩家未拥有某机师，但是拥有该机师的碎片时，可以通过专属合成获得该机师。\n2.当玩家已拥有某机师，并再次招募到该机师时，将会转化为相应的碎片数量，并增加到机师的军衔进度中。\n3.普通机师信物可用于兑换紫色品质机师，高级机师信物可用于兑换橙色品质机师。"
ExplainTemplateLang["机师晋升"] = "机师晋升"
ExplainTemplateLang["1.消耗金币同时消耗专属机师信物，可以晋升机师，提升属性。\n2.机师默认晋升等级为少校，通过晋升可以依次升为中校、上校、少将、中将、上将、元帅（仅限橙色机师）。\n3.机师晋升后，将获得晋升属性。\n4.紫色橙色品质的机师在晋升到中将和上将后，还能大幅提升某些机甲技能的效果。请在机师任命时注意！挑选特长属性和晋升属性两方面都与机甲匹配的机师，能够发挥其最大价值。\n5.橙色机师达到上将后可以消耗一定材料晋阶为红色机师，大幅提升基础属性，获得新的晋升属性。晋阶所需的英勇奖章通过商城购买、商店兑换或活动获得。"] = "1.消耗金币同时消耗专属机师信物，可以晋升机师，提升属性。\n2.机师默认晋升等级为少校，通过晋升可以依次升为中校、上校、少将、中将、上将、元帅（仅限橙色机师）。\n3.机师晋升后，将获得晋升属性。\n4.紫色橙色品质的机师在晋升到中将和上将后，还能大幅提升某些机甲技能的效果。请在机师任命时注意！挑选特长属性和晋升属性两方面都与机甲匹配的机师，能够发挥其最大价值。\n5.橙色机师达到上将后可以消耗一定材料晋阶为红色机师，大幅提升基础属性，获得新的晋升属性。晋阶所需的英勇奖章通过商城购买、商店兑换或活动获得。"
ExplainTemplateLang["机师升级"] = "机师升级"
ExplainTemplateLang["1.机师的等级不能超过角色等级。\n2.机师升级消耗金币。\n3.VIP3级可以使用自动升级功能。"] = "1.机师的等级不能超过角色等级。\n2.机师升级消耗金币。\n3.VIP3级可以使用自动升级功能。"
ExplainTemplateLang["机师解雇"] = "机师解雇"
ExplainTemplateLang["1.解雇机师后，玩家将获得机师升级晋升消耗的部分金币；同时，机师晋升消耗的碎片和玩家持有的该机师信物，将按照合成机师所需的碎片数量的倍数进行部分返还，返还形式为机师信物。返还后剩余的机师信物，将被放置在专属合成列表中。\n2.解雇蓝绿白品质的机师，可得普通机师信物；解雇橙紫品质的机师，可得高级机师信物。"] = "1.解雇机师后，玩家将获得机师升级晋升消耗的部分金币；同时，机师晋升消耗的碎片和玩家持有的该机师信物，将按照合成机师所需的碎片数量的倍数进行部分返还，返还形式为机师信物。返还后剩余的机师信物，将被放置在专属合成列表中。\n2.解雇蓝绿白品质的机师，可得普通机师信物；解雇橙紫品质的机师，可得高级机师信物。"
ExplainTemplateLang["机师退役和高级解雇"] = "机师退役和高级解雇"
ExplainTemplateLang["1.只有未任命的机师才会显示在退役列表中。\n2.退役\n退役会把机师变为初始形态，同时返还升级及晋升所消耗的全部金币，并将晋升消耗的碎片全部返还。\n3.高级解雇\n（1）高级解雇机师后，玩家将获得机师升级晋升消耗的全部金币；同时，机师晋升消耗的碎片和玩家持有的该机师信物，将按照合成机师所需的碎片数量的倍数进行全部返还，返还形式为机师信物。返还后剩余的机师信物，将被放置在专属合成列表中。\n（2）高级解雇蓝绿白品质的机师，可得普通机师信物；高级解雇橙紫品质的机师，可得高级机师信物。"] = "1.只有未任命的机师才会显示在退役列表中。\n2.退役\n退役会把机师变为初始形态，同时返还升级及晋升所消耗的全部金币，并将晋升消耗的碎片全部返还。\n3.高级解雇\n（1）高级解雇机师后，玩家将获得机师升级晋升消耗的全部金币；同时，机师晋升消耗的碎片和玩家持有的该机师信物，将按照合成机师所需的碎片数量的倍数进行全部返还，返还形式为机师信物。返还后剩余的机师信物，将被放置在专属合成列表中。\n（2）高级解雇蓝绿白品质的机师，可得普通机师信物；高级解雇橙紫品质的机师，可得高级机师信物。"
ExplainTemplateLang["机师任命和更换机师"] = "机师任命和更换机师"
ExplainTemplateLang["1.任命机师时，挑选在特长属性和晋升属性两方面都与机甲匹配的机师，能够发挥其最大价值。\n2.机师任命列表按照机师品质、晋升等级、等级依次进行排序。"] = "1.任命机师时，挑选在特长属性和晋升属性两方面都与机甲匹配的机师，能够发挥其最大价值。\n2.机师任命列表按照机师品质、晋升等级、等级依次进行排序。"
ExplainTemplateLang["机师信物"] = "机师信物"
ExplainTemplateLang["获得相同机师信物可增加进度条进度，进度条满后可以晋升军衔。机师信物可通过招募相同机师和各种活动获得。"] = "获得相同机师信物可增加进度条进度，进度条满后可以晋升军衔。机师信物可通过招募相同机师和各种活动获得。"
ExplainTemplateLang["天天特价"] = "天天特价"
ExplainTemplateLang["1.天天特价，默认9折，最低惊爆2折！\n2.先刷出心仪商品，再刷出低折扣，然后买买买，买的越多省的越多！\n3.刷新商品后，折扣会自动回到9折。\n4.免费刷新商品加20积分，免费刷新折扣加10积分，付费刷新和钻石购买商品，花多少钻加多少积分，金币购买商品不增加积分。积分达到一定档位后，立即获得积分奖励！\n5.活动结束后，积分排名前10且积分大于5000的玩家能够领取大奖！\n6.积分奖励和排名奖励都通过领奖中心自动发放，请及时领取。\n7.每天在天天特价中获得的积分上限为20万分，超过上限后当天将无法继续刷新或购买"] = "1.天天特价，默认9折，最低惊爆2折！\n2.先刷出心仪商品，再刷出低折扣，然后买买买，买的越多省的越多！\n3.刷新商品后，折扣会自动回到9折。\n4.免费刷新商品加20积分，免费刷新折扣加10积分，付费刷新和钻石购买商品，花多少钻加多少积分，金币购买商品不增加积分。积分达到一定档位后，立即获得积分奖励！\n5.活动结束后，积分排名前10且积分大于5000的玩家能够领取大奖！\n6.积分奖励和排名奖励都通过领奖中心自动发放，请及时领取。\n7.每天在天天特价中获得的积分上限为20万分，超过上限后当天将无法继续刷新或购买"
ExplainTemplateLang["军团争霸赛"] = "军团争霸赛"
ExplainTemplateLang["欢迎参加军团争霸赛,比赛将根据服务器开启时间分为上、下两个半区,各自半区的军团独立进行竞技,决出最终冠军\n每周为一个赛季,分为报名阶段、预选赛阶段、晋级赛阶段\n※报名阶段※\n1.赛季第1日0:00~3日23:00为报名阶段\n2.军团长和副军团长可以报名\n3.只有满足条件的军团才可以报名,条件包括：\n(1)服务器开服3天以上\n(2)军团等级达到3级\n(3)军团40级以上的成员数量大于等于5\n(4)最多可报名1000个军团\n4.报名时,需要选择本军团的参赛成员名单\n(1)只能选择40级以上的成员\n(2)最少选择5名,最多选择20名\n(3)报名截止后无法进行修改,即之后加入的成员无法参加本赛季比赛\n\n※预选赛阶段※\n1.预选赛期间,每个军团将进行14轮比赛,每日一轮\n2. 22:00~23:00,系统会根据积分随机1个军团作为对手\n3. 23:00~10:00,玩家可以看到对手的信息,但无法攻击\n4. 10:00~22:00,军团双方进行比赛,详见[比赛规则]\n5.每轮比赛结束后,将发放比赛奖励并结算积分排名\n6.相同积分将根据军团活跃度和战斗力进行排序\n7.轮空的军团将直接获得胜利\n\n※比赛规则※\n1.比赛双方成员各自防守20个基地,如果玩家报名数量不足,将由NPC守卫军替代\n2.比赛期间每名成员均可进攻两次,VIP10以上的玩家可花费300钻石额外增加一次\n3.玩家可手动选择任意一个敌军基地进行攻击,并根据敌我双方的损失,为军团获得[0~3]颗星\n4.每个基地造成的损失以最佳战绩为准(即一个基地最多只可获得3颗星)\n5.每轮比赛结束后,获得星星数更多的军团取得胜利;星星数相同,预选赛阶段视作平局,晋级赛阶段积分排名更高者获胜\n6.每轮比赛结束后,胜利方增加积分,失败方减少积分,战平则积分不变,晋级赛阶段积分不变\n\n※晋级赛阶段※\n1.预选赛结束后的17~21日为晋级赛阶段\n2.预选赛积分排名前16名的军团将进入晋级赛,并自动生成对阵表\n3.每日22:00~次日10:00,玩家可选择一个军团进行支持\n(1)如果该军团成功进入下一阶段比赛,可获得支持奖励\n(2)支持需消耗10万金币\n(3)支持奖励为100万金币和25推进剂点\n(4)参赛军团的所有成员不能进行支持\n4.比赛阶段规则与预选赛相同\n\n※奖励规则※\n军团争霸赛奖励包括4部分：\n*战功奖励\n1.预选赛阶段,玩家每次攻击后,都能立即获得一定数量战功和金币\n2.战功越多,金币越多\n*比赛奖励\n1.每轮预选赛和晋级赛结束后,发放比赛奖励\n2.比赛奖励将根据胜平负结果,发放给所有军团成员\n*个人排名奖励\n1.所有参赛玩家根据获得总战功进行个人排行\n2.预选赛结束后,根据个人的总战功排名发放个人排名奖励\n*军团排名奖励\n1.所有军团根据积分进行军团排名\n2.晋级赛结束后,根据最终的军团排名发放排名奖励\n3.军团长和副军团长可额外获得更多奖励\n*膜拜奖励\n1.晋级赛结束至下届比赛开始前,可膜拜本届冠军\n2.膜拜需要消耗钻石,奖励威望和推进剂点\n*发放方式\n1.战功奖励在攻击后立即获得\n2.膜拜奖励在膜拜后立即获得\n3.其他奖励均在领奖中心发放"] = "欢迎参加军团争霸赛,比赛将根据服务器开启时间分为上、下两个半区,各自半区的军团独立进行竞技,决出最终冠军\n每周为一个赛季,分为报名阶段、预选赛阶段、晋级赛阶段\n※报名阶段※\n1.赛季第1日0:00~3日23:00为报名阶段\n2.军团长和副军团长可以报名\n3.只有满足条件的军团才可以报名,条件包括：\n(1)服务器开服3天以上\n(2)军团等级达到3级\n(3)军团40级以上的成员数量大于等于5\n(4)最多可报名1000个军团\n4.报名时,需要选择本军团的参赛成员名单\n(1)只能选择40级以上的成员\n(2)最少选择5名,最多选择20名\n(3)报名截止后无法进行修改,即之后加入的成员无法参加本赛季比赛\n\n※预选赛阶段※\n1.预选赛期间,每个军团将进行14轮比赛,每日一轮\n2. 22:00~23:00,系统会根据积分随机1个军团作为对手\n3. 23:00~10:00,玩家可以看到对手的信息,但无法攻击\n4. 10:00~22:00,军团双方进行比赛,详见[比赛规则]\n5.每轮比赛结束后,将发放比赛奖励并结算积分排名\n6.相同积分将根据军团活跃度和战斗力进行排序\n7.轮空的军团将直接获得胜利\n\n※比赛规则※\n1.比赛双方成员各自防守20个基地,如果玩家报名数量不足,将由NPC守卫军替代\n2.比赛期间每名成员均可进攻两次,VIP10以上的玩家可花费300钻石额外增加一次\n3.玩家可手动选择任意一个敌军基地进行攻击,并根据敌我双方的损失,为军团获得[0~3]颗星\n4.每个基地造成的损失以最佳战绩为准(即一个基地最多只可获得3颗星)\n5.每轮比赛结束后,获得星星数更多的军团取得胜利;星星数相同,预选赛阶段视作平局,晋级赛阶段积分排名更高者获胜\n6.每轮比赛结束后,胜利方增加积分,失败方减少积分,战平则积分不变,晋级赛阶段积分不变\n\n※晋级赛阶段※\n1.预选赛结束后的17~21日为晋级赛阶段\n2.预选赛积分排名前16名的军团将进入晋级赛,并自动生成对阵表\n3.每日22:00~次日10:00,玩家可选择一个军团进行支持\n(1)如果该军团成功进入下一阶段比赛,可获得支持奖励\n(2)支持需消耗10万金币\n(3)支持奖励为100万金币和25推进剂点\n(4)参赛军团的所有成员不能进行支持\n4.比赛阶段规则与预选赛相同\n\n※奖励规则※\n军团争霸赛奖励包括4部分：\n*战功奖励\n1.预选赛阶段,玩家每次攻击后,都能立即获得一定数量战功和金币\n2.战功越多,金币越多\n*比赛奖励\n1.每轮预选赛和晋级赛结束后,发放比赛奖励\n2.比赛奖励将根据胜平负结果,发放给所有军团成员\n*个人排名奖励\n1.所有参赛玩家根据获得总战功进行个人排行\n2.预选赛结束后,根据个人的总战功排名发放个人排名奖励\n*军团排名奖励\n1.所有军团根据积分进行军团排名\n2.晋级赛结束后,根据最终的军团排名发放排名奖励\n3.军团长和副军团长可额外获得更多奖励\n*膜拜奖励\n1.晋级赛结束至下届比赛开始前,可膜拜本届冠军\n2.膜拜需要消耗钻石,奖励威望和推进剂点\n*发放方式\n1.战功奖励在攻击后立即获得\n2.膜拜奖励在膜拜后立即获得\n3.其他奖励均在领奖中心发放"
ExplainTemplateLang["套装效果"] = "套装效果"
ExplainTemplateLang["1.同一机甲装备有2件、3件及4件红色配件时，会依次激活三条强力套装属性。\n2.套装属性包含[压制]属性，效果是每次受到机甲的技能攻击时，临时降低其技能等级1级[最低降到1级]，从而降低受到的伤害。\n3.降低技能等级只会对敌方玩家生效，对NPC无效；只有具有[压制]属性的机甲受到的伤害会降低，己方阵型中其他不具有[压制]属性的机甲受到的伤害正常。"] = "1.同一机甲装备有2件、3件及4件红色配件时，会依次激活三条强力套装属性。\n2.套装属性包含[压制]属性，效果是每次受到机甲的技能攻击时，临时降低其技能等级1级[最低降到1级]，从而降低受到的伤害。\n3.降低技能等级只会对敌方玩家生效，对NPC无效；只有具有[压制]属性的机甲受到的伤害会降低，己方阵型中其他不具有[压制]属性的机甲受到的伤害正常。"
ExplainTemplateLang["军团BOSS"] = "军团BOSS"
ExplainTemplateLang["1.军团长或副军团长可以开启军团BOSS挑战，每个军团每周最多开启两次。\n2.9:00-22:00期间可以对军团BOSS发起挑战，每个军团成员每天最多可以挑战两次。\n3.可以选择挑战不同的军团BOSS，获得的排名奖励不同。每个军团BOSS需要军团达到指定等级才能够开启挑战。\n4.军团BOSS被击杀后，军团成员能够根据伤害排名获得对应奖励。造成最后一击的玩家还能够额外获得一份击杀奖励。\n5.BOSS在开启时可以选择难度，难度越高，获得的排名奖励越丰厚。军团等级越高，获得的奖励也越丰厚。48小时内击杀BOSS所有参加挑战的军团成员能够获得一份速杀奖励。\n6.玩家每次战斗能够获得金币奖励，造成伤害越多，获得金币越多。\n7.每次挑战会有随机一种类型的机甲获得技能伤害加成。\n军团BOSS介绍\n※橙卡待定1※\n本机是自月面环型山中发掘出来的黑历史遗留下的机体，开发的年代及机体的具体性能都是个谜。从黑历史遗留下来的资料来看，TURN A高达是由地球方面为镇压宇宙殖民地而制造的机体，曾经在战斗中重创过同类机体TURN X高达，最后还一度毁灭了地球上的人类文明。\n普通技能：对敌方单体造成爆裂攻击伤害。\n主动技能：对敌方随机3个目标造成爆裂攻击伤害。\n※橙卡待定2※\nMS-09RS使用了最新的磁气覆膜技术，提高了机体的反应能力；为了配合夏亚的NEWTYPE能力，技术人员还特地对机体的追踪性和机动力进行了强化；另外还更换了高出力的发电机，使机体可以搭载光束火箭炮。\n普通技能：对敌方单体造成破甲攻击伤害。\n主动技能：对敌方随机三个目标造成破甲攻击伤害。\n※橙卡待定3※\n奥古和阿纳海姆公司共同制定的“Z计划”所开发制造的可变形MS（TMS）。卡缪・维丹以Z高达代替了RX-178 高达MK II作为自己的专用机。由于自身新人类能力和新机体强大性能，他在奥古反提坦斯一系列战役中取得了辉煌的战绩。\n普通技能：对敌方随机4个目标造成破甲攻击伤害。\n主动技能：对敌方前排造成破甲攻击伤害。"] = "1.军团长或副军团长可以开启军团BOSS挑战，每个军团每周最多开启两次。\n2.9:00-22:00期间可以对军团BOSS发起挑战，每个军团成员每天最多可以挑战两次。\n3.可以选择挑战不同的军团BOSS，获得的排名奖励不同。每个军团BOSS需要军团达到指定等级才能够开启挑战。\n4.军团BOSS被击杀后，军团成员能够根据伤害排名获得对应奖励。造成最后一击的玩家还能够额外获得一份击杀奖励。\n5.BOSS在开启时可以选择难度，难度越高，获得的排名奖励越丰厚。军团等级越高，获得的奖励也越丰厚。48小时内击杀BOSS所有参加挑战的军团成员能够获得一份速杀奖励。\n6.玩家每次战斗能够获得金币奖励，造成伤害越多，获得金币越多。\n7.每次挑战会有随机一种类型的机甲获得技能伤害加成。\n军团BOSS介绍\n※橙卡待定1※\n本机是自月面环型山中发掘出来的黑历史遗留下的机体，开发的年代及机体的具体性能都是个谜。从黑历史遗留下来的资料来看，TURN A高达是由地球方面为镇压宇宙殖民地而制造的机体，曾经在战斗中重创过同类机体TURN X高达，最后还一度毁灭了地球上的人类文明。\n普通技能：对敌方单体造成爆裂攻击伤害。\n主动技能：对敌方随机3个目标造成爆裂攻击伤害。\n※橙卡待定2※\nMS-09RS使用了最新的磁气覆膜技术，提高了机体的反应能力；为了配合夏亚的NEWTYPE能力，技术人员还特地对机体的追踪性和机动力进行了强化；另外还更换了高出力的发电机，使机体可以搭载光束火箭炮。\n普通技能：对敌方单体造成破甲攻击伤害。\n主动技能：对敌方随机三个目标造成破甲攻击伤害。\n※橙卡待定3※\n奥古和阿纳海姆公司共同制定的“Z计划”所开发制造的可变形MS（TMS）。卡缪・维丹以Z高达代替了RX-178 高达MK II作为自己的专用机。由于自身新人类能力和新机体强大性能，他在奥古反提坦斯一系列战役中取得了辉煌的战绩。\n普通技能：对敌方随机4个目标造成破甲攻击伤害。\n主动技能：对敌方前排造成破甲攻击伤害。"
ExplainTemplateLang["配件回收"] = "配件回收"
ExplainTemplateLang["1.只有橙色配件可以被回收。\n2.回收后原配件消失，转化为一定数量的[精密零件]，可用于Ⅲ型橙色配件进阶至[红色配件]。\n3.配件升级和改造所消耗的金币与科技点，回收时会按照一定比例返还[与出售相同]。\n4.进阶要求配件等级不低于240级，改造等级不低于6级。"] = "1.只有橙色配件可以被回收。\n2.回收后原配件消失，转化为一定数量的[精密零件]，可用于Ⅲ型橙色配件进阶至[红色配件]。\n3.配件升级和改造所消耗的金币与科技点，回收时会按照一定比例返还[与出售相同]。\n4.进阶要求配件等级不低于240级，改造等级不低于6级。"
ExplainTemplateLang["配件进阶"] = "配件进阶"
ExplainTemplateLang["1.Ⅲ型橙色配件可以消耗一定材料进阶为红色配件。\n2.进阶后，基础属性和改造属性大幅提升，配件等级和改造等级会被继承。\n3.同一机甲装备有2件、3件及4件红色配件时，会依次激活三条强力套装属性。\n4.套装属性包含[压制]属性，效果是每次受到机甲的技能攻击时，临时降低其技能等级1级[最低降到1级]，从而降低受到的伤害。\n5.红色配件的升级和改造消耗与原橙色配件一致。\n6.进阶所需的精密零件通过配件[回收]功能得到。尖端仪器通过商城购买、商店兑换或活动获得。"] = "1.Ⅲ型橙色配件可以消耗一定材料进阶为红色配件。\n2.进阶后，基础属性和改造属性大幅提升，配件等级和改造等级会被继承。\n3.同一机甲装备有2件、3件及4件红色配件时，会依次激活三条强力套装属性。\n4.套装属性包含[压制]属性，效果是每次受到机甲的技能攻击时，临时降低其技能等级1级[最低降到1级]，从而降低受到的伤害。\n5.红色配件的升级和改造消耗与原橙色配件一致。\n6.进阶所需的精密零件通过配件[回收]功能得到。尖端仪器通过商城购买、商店兑换或活动获得。"
ExplainTemplateLang["预备机甲&预设阵型"] = "预备机甲&预设阵型"
ExplainTemplateLang["※预备机甲※\n1.第一辆预备机甲55级开启，第二辆预备机甲65级开启，开启后需要指挥官手动添加预备机甲。\n2.当上阵机甲被击毁时，预备机甲会依据击毁次序和位置上场，替换原机甲进行攻击或者作为目标被攻击。\n3.每辆预备机甲每场战斗只可替补上场一次。\n4.每辆预备机甲有其独立的配件、勋章和机师，功能开启后需要指挥官手动添加。\n5.预备机甲的速度会增加到整体速度中。\n6.能源保卫战中，预备机甲不可上场进行替补，同时也不影响整体速度。\n\n※预设阵型※\n1.60级解锁预设阵型系统，共可配置5套不同的阵型。\n2.玩家可随时在阵型界面调整并保存各套阵型，对应玩法的阵型也将即时生效。\n3.可预设默认阵型的玩法\n(1)自带阵型配置的玩法可预设默认阵型\n(2)玩法的默认阵型为--玩家在玩法自带的阵型界面'点击关闭按钮'时选中的阵型\n(3)可预设阵型的玩法包括：战役、能源保卫战、最强机体、军团BOSS、决战月球、宇宙战争、竞技场、军团争霸赛、勇气争锋等。\n如：在最强机体玩法界面中打开'调整阵型'，然后调整'阵型3'并关闭，下次最强机体战斗时将使用阵型3\n4.不可预设默认阵型的玩法\n(1)无自带阵型配置的玩法，战斗时将始终使用'阵型1'。\n(2)不可预设阵型的玩法包括：殖民星宝藏、突袭补给站、配件抢夺等。"] = "※预备机甲※\n1.第一辆预备机甲55级开启，第二辆预备机甲65级开启，开启后需要指挥官手动添加预备机甲。\n2.当上阵机甲被击毁时，预备机甲会依据击毁次序和位置上场，替换原机甲进行攻击或者作为目标被攻击。\n3.每辆预备机甲每场战斗只可替补上场一次。\n4.每辆预备机甲有其独立的配件、勋章和机师，功能开启后需要指挥官手动添加。\n5.预备机甲的速度会增加到整体速度中。\n6.能源保卫战中，预备机甲不可上场进行替补，同时也不影响整体速度。\n\n※预设阵型※\n1.60级解锁预设阵型系统，共可配置5套不同的阵型。\n2.玩家可随时在阵型界面调整并保存各套阵型，对应玩法的阵型也将即时生效。\n3.可预设默认阵型的玩法\n(1)自带阵型配置的玩法可预设默认阵型\n(2)玩法的默认阵型为--玩家在玩法自带的阵型界面'点击关闭按钮'时选中的阵型\n(3)可预设阵型的玩法包括：战役、能源保卫战、最强机体、军团BOSS、决战月球、宇宙战争、竞技场、军团争霸赛、勇气争锋等。\n如：在最强机体玩法界面中打开'调整阵型'，然后调整'阵型3'并关闭，下次最强机体战斗时将使用阵型3\n4.不可预设默认阵型的玩法\n(1)无自带阵型配置的玩法，战斗时将始终使用'阵型1'。\n(2)不可预设阵型的玩法包括：殖民星宝藏、突袭补给站、配件抢夺等。"
ExplainTemplateLang["粒子争夺战"] = "粒子争夺战"
ExplainTemplateLang["1.概要\n(1)粒子争夺战是分等级段的跨服玩法。\n(2)等级达到60级的玩家可以参与。\n(3)等级段划分为60-89级和90级以上两段。\n(4)每周五9点到下周一22点30开启。\n(5)每天9点至22点30分可以发起挑战。\n\n2.段位与排名\n(1)玩家根据排名被分为多个级别，称作段位。\n(2)段位从高到低共有13个;\n分别是传奇王者组、钻石组Ⅰ~Ⅲ阶、黄金组Ⅰ~Ⅲ阶、白银组Ⅰ~Ⅲ阶、青铜组Ⅰ~Ⅲ阶。\n(3)除最低的青铜组Ⅲ阶外，其他所有段位都有名额限制。\n(4)玩家达到当前段位指定的名次，可挑战更高段位的玩家。如果挑战成功，将晋级到更高段位，并立即领取晋级奖励。\n(5)活动开始时，所有玩家都要从最低段位的最后一名开打。\n(6)如果挑战比自己排名高的其他玩家，战斗胜利则双方交换名次；战斗失败，则双方名次不变。挑战比自己排名低的玩家，无论战斗胜利还是失败，双方名次都不变。\n\n3.段位晋级\n(1)玩家达到当前段位指定名次范围后，可挑战系统匹配的对手。选择任意一位对手进行挑战，如果成功，玩家将与对手互换段位和段位名次。\n(2)玩家取得的连胜次数越多，发起晋级挑战时越容易匹配到更高段位的对手。从而可以实现跳段位晋级，快速提升排名。\n\n4.Gn粒子\n(1)玩家通过占据段位与段位排名，可获得一定的Gn粒子产出效率。段位排名越高，Gn粒子的产出效率就越高。\n(2)Gn粒子每隔10分钟自动产出1次，无需手动收取。\n(3)Gn粒子有囤积上限，达到上限后不再自动产出，但挑战对手仍可抢夺Gn粒子。\n(4)使用Gn粒子可在兑换商店中兑换指定资源与道具。\n\n5.挑战与抢夺\n(1)每天赠送10次免费挑战次数，次数用完需花费钻石购买。\n(2)被抢夺后有一定时间保护期，保护期内Gn粒子不会被抢。\n(3)每挑战一次增加10分钟冷却，超过30分钟后，需要等待挑战冷却结束才可继续挑战，或花费钻石清除冷却时间。\n(4)战胜NPC和其他玩家，均可获得一定数量的Gn粒子。\n(5)抢夺其他玩家时，对手战力越高可抢夺的Gn粒子越多。\n\n6.奖励\n(1)排名奖励将在粒子争夺战结束后通过领奖中心发放。\n(2)玩家每次晋级成功后，可立即在领奖中心领取晋级奖励。\n\n7.精彩对决\n只有精彩激烈的对局，才能入选。"] = "1.概要\n(1)粒子争夺战是分等级段的跨服玩法。\n(2)等级达到60级的玩家可以参与。\n(3)等级段划分为60-89级和90级以上两段。\n(4)每周五9点到下周一22点30开启。\n(5)每天9点至22点30分可以发起挑战。\n\n2.段位与排名\n(1)玩家根据排名被分为多个级别，称作段位。\n(2)段位从高到低共有13个;\n分别是传奇王者组、钻石组Ⅰ~Ⅲ阶、黄金组Ⅰ~Ⅲ阶、白银组Ⅰ~Ⅲ阶、青铜组Ⅰ~Ⅲ阶。\n(3)除最低的青铜组Ⅲ阶外，其他所有段位都有名额限制。\n(4)玩家达到当前段位指定的名次，可挑战更高段位的玩家。如果挑战成功，将晋级到更高段位，并立即领取晋级奖励。\n(5)活动开始时，所有玩家都要从最低段位的最后一名开打。\n(6)如果挑战比自己排名高的其他玩家，战斗胜利则双方交换名次；战斗失败，则双方名次不变。挑战比自己排名低的玩家，无论战斗胜利还是失败，双方名次都不变。\n\n3.段位晋级\n(1)玩家达到当前段位指定名次范围后，可挑战系统匹配的对手。选择任意一位对手进行挑战，如果成功，玩家将与对手互换段位和段位名次。\n(2)玩家取得的连胜次数越多，发起晋级挑战时越容易匹配到更高段位的对手。从而可以实现跳段位晋级，快速提升排名。\n\n4.Gn粒子\n(1)玩家通过占据段位与段位排名，可获得一定的Gn粒子产出效率。段位排名越高，Gn粒子的产出效率就越高。\n(2)Gn粒子每隔10分钟自动产出1次，无需手动收取。\n(3)Gn粒子有囤积上限，达到上限后不再自动产出，但挑战对手仍可抢夺Gn粒子。\n(4)使用Gn粒子可在兑换商店中兑换指定资源与道具。\n\n5.挑战与抢夺\n(1)每天赠送10次免费挑战次数，次数用完需花费钻石购买。\n(2)被抢夺后有一定时间保护期，保护期内Gn粒子不会被抢。\n(3)每挑战一次增加10分钟冷却，超过30分钟后，需要等待挑战冷却结束才可继续挑战，或花费钻石清除冷却时间。\n(4)战胜NPC和其他玩家，均可获得一定数量的Gn粒子。\n(5)抢夺其他玩家时，对手战力越高可抢夺的Gn粒子越多。\n\n6.奖励\n(1)排名奖励将在粒子争夺战结束后通过领奖中心发放。\n(2)玩家每次晋级成功后，可立即在领奖中心领取晋级奖励。\n\n7.精彩对决\n只有精彩激烈的对局，才能入选。"
ExplainTemplateLang["军团红包"] = "军团红包"
ExplainTemplateLang["1.军团成员可以在军团内发红包和抢红包。红包数量有限，需要尽快领取。\n2.每个红包每人最多只能领取1次。每日红包每日9:00重置，重置后可以重新领取。\n3.发红包只需要消耗红包积分，红包积分通过参加特定限时活动获得。退出军团后红包积分保留。\n4.发红包后发放者也能抢自己发放的红包，还能够获得一份额外奖励。\n5.发出的红包24小时未领取完将自动消失，剩余额度不返还。"] = "1.军团成员可以在军团内发红包和抢红包。红包数量有限，需要尽快领取。\n2.每个红包每人最多只能领取1次。每日红包每日9:00重置，重置后可以重新领取。\n3.发红包只需要消耗红包积分，红包积分通过参加特定限时活动获得。退出军团后红包积分保留。\n4.发红包后发放者也能抢自己发放的红包，还能够获得一份额外奖励。\n5.发出的红包24小时未领取完将自动消失，剩余额度不返还。"
ExplainTemplateLang["改造间"] = "改造间"
ExplainTemplateLang["1.改造间系统中拥有不同属性偏向的多套改造间，每套改造间拥有不同的子改造间组合，可以切换使用不同的改造间，但同一时间只能使用一套改造间，且只有当前使用改造间的属性才会生效。\n2.每套改造间包含10个子改造间和1个装配中心，子改造间可以增强一辆机甲的某个属性，不同类型的子改造间可增强不同的属性，装配中心可以增强全体机甲的属性。\n3.每套改造间初始均为未开启状态，消耗改造图纸可以开启改造间，改造间开启后上阵机甲会自动放入子改造间中，可以拖动来调换机甲所在的子改造间。\n4.子改造间和装配中心可以进行升级操作，升级所需的宇宙精华和改造图纸可在核能商店中兑换获得。\n5.开启后的改造间可以重置，重置改造间消耗钻石同时100%返还所有的开启和升级材料。"] = "1.改造间系统中拥有不同属性偏向的多套改造间，每套改造间拥有不同的子改造间组合，可以切换使用不同的改造间，但同一时间只能使用一套改造间，且只有当前使用改造间的属性才会生效。\n2.每套改造间包含10个子改造间和1个装配中心，子改造间可以增强一辆机甲的某个属性，不同类型的子改造间可增强不同的属性，装配中心可以增强全体机甲的属性。\n3.每套改造间初始均为未开启状态，消耗改造图纸可以开启改造间，改造间开启后上阵机甲会自动放入子改造间中，可以拖动来调换机甲所在的子改造间。\n4.子改造间和装配中心可以进行升级操作，升级所需的宇宙精华和改造图纸可在核能商店中兑换获得。\n5.开启后的改造间可以重置，重置改造间消耗钻石同时100%返还所有的开启和升级材料。"
ExplainTemplateLang["机师挑战"] = "机师挑战"
ExplainTemplateLang["1.机师挑战玩法70级开放，每天可参与1次，每日0点重置。\n2.机师挑战玩法共有15个关卡，每一关卡均有简单、普通、困难3个难度的对手供玩家选择挑战，各难度对手存在相应的增益或减益效果；难度越高，挑战成功后奖励越高。\n3.开始挑战关卡后，我方阵型机甲位置可以自由调整，其他所有属性均被锁定（机甲、机甲属性、配件、勋章、机师、改造间等），直至本次活动重置，该规则不影响其他功能或玩法。\n4.机师挑战关卡战斗去除速度影响，我方优先开始攻击。\n5.关卡挑战过程中，进入新的关卡时，我方机甲生命值不会重置；当所有机甲生命值为0时，挑战失败；每个关卡失败后均可消耗挑战次数恢复战前状态重新挑战。\n6.每次挑战关卡成功后，可获得挑战评级星，难度越高，战胜消耗生命越少，星数越多；评级星累计后可在挑战偶数关卡成功后兑换补给；评级星数量每日0点重置。\n7.挑战失败会扣除一次挑战次数,玩家每天都有一定免费挑战次数，并可花费钻石购买更多次数。\n8.挑战成功后若对结果不满意，可以选择再次挑战，再次挑战会重新计算所得星星，但不会再次获得过关奖励，并且无论挑战成功与否均会扣除一次挑战次数。\n9.成功挑战奇数关卡后可开启征服宝藏，宝藏开启次数和奖励随关卡深度增加，并且都拥有若干次免费开启次数，免费开启次数随关卡的不同而不同。"] = "1.机师挑战玩法70级开放，每天可参与1次，每日0点重置。\n2.机师挑战玩法共有15个关卡，每一关卡均有简单、普通、困难3个难度的对手供玩家选择挑战，各难度对手存在相应的增益或减益效果；难度越高，挑战成功后奖励越高。\n3.开始挑战关卡后，我方阵型机甲位置可以自由调整，其他所有属性均被锁定（机甲、机甲属性、配件、勋章、机师、改造间等），直至本次活动重置，该规则不影响其他功能或玩法。\n4.机师挑战关卡战斗去除速度影响，我方优先开始攻击。\n5.关卡挑战过程中，进入新的关卡时，我方机甲生命值不会重置；当所有机甲生命值为0时，挑战失败；每个关卡失败后均可消耗挑战次数恢复战前状态重新挑战。\n6.每次挑战关卡成功后，可获得挑战评级星，难度越高，战胜消耗生命越少，星数越多；评级星累计后可在挑战偶数关卡成功后兑换补给；评级星数量每日0点重置。\n7.挑战失败会扣除一次挑战次数,玩家每天都有一定免费挑战次数，并可花费钻石购买更多次数。\n8.挑战成功后若对结果不满意，可以选择再次挑战，再次挑战会重新计算所得星星，但不会再次获得过关奖励，并且无论挑战成功与否均会扣除一次挑战次数。\n9.成功挑战奇数关卡后可开启征服宝藏，宝藏开启次数和奖励随关卡深度增加，并且都拥有若干次免费开启次数，免费开启次数随关卡的不同而不同。"
ExplainTemplateLang["巅峰对决"] = "巅峰对决"
ExplainTemplateLang["巅峰对决是全服玩家共同参与的个人角逐，共分为三个阶段：报名阶段、多服比赛阶段和全服比赛阶段，全服玩家一起争夺排名，决出全服最强王者！\n[报名阶段]\n报名资格：开服大于等于40天，等级大于等于80级的玩家可报名参加巅峰对决\n[多服比赛阶段]\n报名开始时满足报名条件的服务器会分为多个服务器组，玩家先在组内进行角逐。多服比赛分为两部分：多服海选赛、多服晋级赛，多服海选赛32强自动进入多服晋级赛。\nA)多服海选赛规则：\n1.随机分配对手，每场比赛1局，每场间隔5分钟；\n2.当玩家累计失败3场后，立即被淘汰，直至决出32强，海选结束。\nB)多服晋级赛规则：\n1.多服海选赛32强玩家分成16组，以每组2人进行5局3胜制比赛，获得3场胜利的玩家晋级，每局比赛进行5分钟，间隔5分钟；\n2.每场晋级赛间隔1天；\n3.多服晋级赛4强自动进入全服比赛阶段。\n[全服比赛阶段]\n全服比赛分为两部分：全服海选赛、全服晋级赛，多服晋级赛4强自动进入全服海选赛，全服海选赛32强自动进入全服晋级赛，决出全服最强王者！\nA)全服海选赛规则：\n1.随机分配对手，每场比赛1局，每场间隔5分钟；\n2.当玩家累计失败5场后，立即被淘汰，直至决出32强，海选结束。\nB)全服晋级赛规则：\n1.全服海选赛32强玩家随机分组，以每组2人进行5局3胜制比赛，获得3场胜利的玩家晋级，至全服半决赛和决赛阶段进行7局4胜制比赛，获得4场胜利的玩家晋级，每局比赛时间5分钟，间隔5分钟；\n2.每场晋级赛间隔1天。\n[竞猜规则]\n在多服和全服4强晋级赛开始前，所有玩家可选择一名参赛选手进行竞猜；当被竞猜方获得相应的冠军后，竞猜方可获得竞猜奖励，当被竞猜方未获得冠军，也能获得一份安慰奖。\n[膜拜规则]\n巅峰对决结束后，全服冠军可以被所有玩家每天膜拜一次，膜拜可获得丰厚奖励，膜拜持续到下次巅峰对决开启。\n[奖励规则]\n多服晋级赛结束后，参加多服比赛的玩家按照成绩排名获得相应奖励；全服晋级赛结束后，参加全服比赛的玩家按照成绩排名获得相应奖励，同时全服冠军所在区的玩家上线后可领取一份奖励。"] = "巅峰对决是全服玩家共同参与的个人角逐，共分为三个阶段：报名阶段、多服比赛阶段和全服比赛阶段，全服玩家一起争夺排名，决出全服最强王者！\n[报名阶段]\n报名资格：开服大于等于40天，等级大于等于80级的玩家可报名参加巅峰对决\n[多服比赛阶段]\n报名开始时满足报名条件的服务器会分为多个服务器组，玩家先在组内进行角逐。多服比赛分为两部分：多服海选赛、多服晋级赛，多服海选赛32强自动进入多服晋级赛。\nA)多服海选赛规则：\n1.随机分配对手，每场比赛1局，每场间隔5分钟；\n2.当玩家累计失败3场后，立即被淘汰，直至决出32强，海选结束。\nB)多服晋级赛规则：\n1.多服海选赛32强玩家分成16组，以每组2人进行5局3胜制比赛，获得3场胜利的玩家晋级，每局比赛进行5分钟，间隔5分钟；\n2.每场晋级赛间隔1天；\n3.多服晋级赛4强自动进入全服比赛阶段。\n[全服比赛阶段]\n全服比赛分为两部分：全服海选赛、全服晋级赛，多服晋级赛4强自动进入全服海选赛，全服海选赛32强自动进入全服晋级赛，决出全服最强王者！\nA)全服海选赛规则：\n1.随机分配对手，每场比赛1局，每场间隔5分钟；\n2.当玩家累计失败5场后，立即被淘汰，直至决出32强，海选结束。\nB)全服晋级赛规则：\n1.全服海选赛32强玩家随机分组，以每组2人进行5局3胜制比赛，获得3场胜利的玩家晋级，至全服半决赛和决赛阶段进行7局4胜制比赛，获得4场胜利的玩家晋级，每局比赛时间5分钟，间隔5分钟；\n2.每场晋级赛间隔1天。\n[竞猜规则]\n在多服和全服4强晋级赛开始前，所有玩家可选择一名参赛选手进行竞猜；当被竞猜方获得相应的冠军后，竞猜方可获得竞猜奖励，当被竞猜方未获得冠军，也能获得一份安慰奖。\n[膜拜规则]\n巅峰对决结束后，全服冠军可以被所有玩家每天膜拜一次，膜拜可获得丰厚奖励，膜拜持续到下次巅峰对决开启。\n[奖励规则]\n多服晋级赛结束后，参加多服比赛的玩家按照成绩排名获得相应奖励；全服晋级赛结束后，参加全服比赛的玩家按照成绩排名获得相应奖励，同时全服冠军所在区的玩家上线后可领取一份奖励。"
ExplainTemplateLang["维修员列表"] = "维修员列表"
ExplainTemplateLang["1.70级开启维修员系统。\n2.每辆机甲可以任命4名维修员，维修员属性只对该机甲生效。\n3.维修员有基础属性、晋升属性和专长属性。\n4.维修员等级不能超过角色等级。\n5.维修员需要达到对应等级才可晋升下一军衔。\n6.维修员的专长属性在晋升到对应等级时解锁，解锁后的专长属性可以通过重修随机类型和数值。\n7.相同作战风格的维修员一同上阵，可以激活作战风格属性。同风格的人数越多，激活属性条数越多。\n8.玩家可以在维修员详情界面对其进行锁定或者解锁操作。锁定后的维修员，不能解雇和退役。"] = "1.70级开启维修员系统。\n2.每辆机甲可以任命4名维修员，维修员属性只对该机甲生效。\n3.维修员有基础属性、晋升属性和专长属性。\n4.维修员等级不能超过角色等级。\n5.维修员需要达到对应等级才可晋升下一军衔。\n6.维修员的专长属性在晋升到对应等级时解锁，解锁后的专长属性可以通过重修随机类型和数值。\n7.相同作战风格的维修员一同上阵，可以激活作战风格属性。同风格的人数越多，激活属性条数越多。\n8.玩家可以在维修员详情界面对其进行锁定或者解锁操作。锁定后的维修员，不能解雇和退役。"
ExplainTemplateLang["维修员退役"] = "维修员退役"
ExplainTemplateLang["1.只有未任命的维修员才会显示在退役列表中。\n2.退役会把维修员变为初始形态，同时返还升级及晋升所消耗的全部资源。并将重修消耗的重修证全部返还。"] = "1.只有未任命的维修员才会显示在退役列表中。\n2.退役会把维修员变为初始形态，同时返还升级及晋升所消耗的全部资源。并将重修消耗的重修证全部返还。"
ExplainTemplateLang["维修员解雇"] = "维修员解雇"
ExplainTemplateLang["1.解雇维修员后，维修员消失并转换为老兵徽章。\n2.返还维修员升级、晋升、重修消耗的部分资源。"] = "1.解雇维修员后，维修员消失并转换为老兵徽章。\n2.返还维修员升级、晋升、重修消耗的部分资源。"
ExplainTemplateLang["维修员升级"] = "维修员升级"
ExplainTemplateLang["1.维修员等级不能超过角色等级。\n2.维修员升级消耗士官点和金币。\n3.VIP3级可以使用自动升级功能。"] = "1.维修员等级不能超过角色等级。\n2.维修员升级消耗士官点和金币。\n3.VIP3级可以使用自动升级功能。"
ExplainTemplateLang["维修员晋升"] = "维修员晋升"
ExplainTemplateLang["1.维修员需要达到对应等级才可晋升下一军衔。\n2.维修员晋升消耗老兵徽章。\n3.维修员晋升后，可获得晋升属性。"] = "1.维修员需要达到对应等级才可晋升下一军衔。\n2.维修员晋升消耗老兵徽章。\n3.维修员晋升后，可获得晋升属性。"
ExplainTemplateLang["维修员专长"] = "维修员专长"
ExplainTemplateLang["1.维修员晋升至[一等兵]、[中士]、[少尉]时，分别解锁一条专长属性。\n2.解锁专长时会立即随机获得一条属性。\n3.解锁专长后，可以通过重修功能重新随机属性类型和数值。"] = "1.维修员晋升至[一等兵]、[中士]、[少尉]时，分别解锁一条专长属性。\n2.解锁专长时会立即随机获得一条属性。\n3.解锁专长后，可以通过重修功能重新随机属性类型和数值。"
ExplainTemplateLang["维修员专长重修"] = "维修员专长重修"
ExplainTemplateLang["1.重修分为普通重修和高级重修。\n2.普通重修消耗金币与重修证，重修会同时随机属性类型与属性数值。\n3.高级重修消耗钻石与重修证，重修只随机属性数值。\n4.每次重修会生成两条属性，可以选择其中一条替换，或者保留原属性。\n5.每个维修员的重修次数越多，消耗的资源越多。每个维修员单独累积重修次数。"] = "1.重修分为普通重修和高级重修。\n2.普通重修消耗金币与重修证，重修会同时随机属性类型与属性数值。\n3.高级重修消耗钻石与重修证，重修只随机属性数值。\n4.每次重修会生成两条属性，可以选择其中一条替换，或者保留原属性。\n5.每个维修员的重修次数越多，消耗的资源越多。每个维修员单独累积重修次数。"
ExplainTemplateLang["维修员作战风格"] = "维修员作战风格"
ExplainTemplateLang["1.相同作战风格的同品质维修员一同上阵，可以激活作战风格属性。\n2.上阵同风格的人数越多，激活属性条数越多。\n3.橙色品质的维修员可以激活3条作战风格属性，紫色品质的维修员有2条，蓝色品质的维修员只有1条。"] = "1.相同作战风格的同品质维修员一同上阵，可以激活作战风格属性。\n2.上阵同风格的人数越多，激活属性条数越多。\n3.橙色品质的维修员可以激活3条作战风格属性，紫色品质的维修员有2条，蓝色品质的维修员只有1条。"
ExplainTemplateLang["征服商店"] = "征服商店"
ExplainTemplateLang["1.征服商店中可以使用征服币兑换商品。\n2.征服商店每日0点自动刷新，也可以手动立即刷新。\n3.手动刷新时优先使用免费次数，没有免费次数时使用1个征服刷新工具，没有工具时使用20钻石。\n4.商店有几率出现特供商品，特供商品每日只会出现1次，请及时兑换。"] = "1.征服商店中可以使用征服币兑换商品。\n2.征服商店每日0点自动刷新，也可以手动立即刷新。\n3.手动刷新时优先使用免费次数，没有免费次数时使用1个征服刷新工具，没有工具时使用20钻石。\n4.商店有几率出现特供商品，特供商品每日只会出现1次，请及时兑换。"

