local GuidebookTemplateLang = {}

GuidebookTemplateLang["%s"] = "%s"
GuidebookTemplateLang["※机甲类型※"] = "※机甲类型※"
GuidebookTemplateLang["游戏中一共有5种类型的机甲，分别是：突击、重击、支援、炮击、狙击。\n狙击速度较高，更容易在战斗中抢占先手。\n支援的生命、防御较高，是战斗中的中流砥柱。\n炮击能力平均，可以适应多种位置。\n突击和重击同属攻强守弱的角色，其中重击拥有出色的攻击力，但速度略逊于突击。"] = "游戏中一共有5种类型的机甲，分别是：突击、重击、支援、炮击、狙击。\n狙击速度较高，更容易在战斗中抢占先手。\n支援的生命、防御较高，是战斗中的中流砥柱。\n炮击能力平均，可以适应多种位置。\n突击和重击同属攻强守弱的角色，其中重击拥有出色的攻击力，但速度略逊于突击。"
GuidebookTemplateLang["_SPACE_"] = ""
GuidebookTemplateLang["※机甲获得※"] = "※机甲获得※"
GuidebookTemplateLang["在游戏中，所有的机甲都可以通过战役、玩法或其他活动来获得。"] = "在游戏中，所有的机甲都可以通过战役、玩法或其他活动来获得。"
GuidebookTemplateLang["※机甲品质※"] = "※机甲品质※"
GuidebookTemplateLang["在游戏中，一共有5种品质的机甲，分别为：橙色，紫色，蓝色，绿色，白色。"] = "在游戏中，一共有5种品质的机甲，分别为：橙色，紫色，蓝色，绿色，白色。"
GuidebookTemplateLang["※机甲进阶※"] = "※机甲进阶※"
GuidebookTemplateLang["60级之后，当橙色机甲改造等级达到+5后，可以通过进阶功能，消耗指定资源将其进阶为红色机甲。红色机甲首轮攻击100%触发主动技能。"] = "60级之后，当橙色机甲改造等级达到+5后，可以通过进阶功能，消耗指定资源将其进阶为红色机甲。红色机甲首轮攻击100%触发主动技能。"
GuidebookTemplateLang["※机甲技能※"] = "※机甲技能※"
GuidebookTemplateLang["每辆机甲都拥有3个技能，分别是：普通技能，主动技能，被动技能。\n每辆机甲的技能均不相同。有的技能可以造成很高的伤害，有的技能攻击多个目标。在阵容界面，可以看到每辆机甲的技能。"] = "每辆机甲都拥有3个技能，分别是：普通技能，主动技能，被动技能。\n每辆机甲的技能均不相同。有的技能可以造成很高的伤害，有的技能攻击多个目标。在阵容界面，可以看到每辆机甲的技能。"
GuidebookTemplateLang["※机甲布阵※"] = "※机甲布阵※"
GuidebookTemplateLang["机甲在战斗时分为前排与后排。在大部分的战斗中，可以把生命高的机甲放在前排，抵抗对手的攻击。攻击高的机甲放到后排，负责攻击对手。\n某些战役中，遇到拥有攻击后排目标的对手时，转换一下布阵思路即可轻松通关。"] = "机甲在战斗时分为前排与后排。在大部分的战斗中，可以把生命高的机甲放在前排，抵抗对手的攻击。攻击高的机甲放到后排，负责攻击对手。\n某些战役中，遇到拥有攻击后排目标的对手时，转换一下布阵思路即可轻松通关。"
GuidebookTemplateLang["※战役※"] = "※战役※"
GuidebookTemplateLang["战役分为普通战役与精英战役。精英战役掉落机甲零件的几率高于普通战役，相应的难度也比普通战役大。"] = "战役分为普通战役与精英战役。精英战役掉落机甲零件的几率高于普通战役，相应的难度也比普通战役大。"
GuidebookTemplateLang["※争霸※"] = "※争霸※"
GuidebookTemplateLang["争霸中有多种玩法，能产出很多资源及道具。比如殖民星宝藏，能够获得大量金币；突袭补给站，能够获得大量科技点。\n打开争霸界面，可以看到各种玩法的信息。"] = "争霸中有多种玩法，能产出很多资源及道具。比如殖民星宝藏，能够获得大量金币；突袭补给站，能够获得大量科技点。\n打开争霸界面，可以看到各种玩法的信息。"
GuidebookTemplateLang["※机甲※"] = "※机甲※"
GuidebookTemplateLang["游戏中，品质越高的机甲属性越好。机甲一般通过战役、派遣特工来获得。"] = "游戏中，品质越高的机甲属性越好。机甲一般通过战役、派遣特工来获得。"
GuidebookTemplateLang["※机甲专属零件※"] = "※机甲专属零件※"
GuidebookTemplateLang["当某一种机甲专属零件收集到一定数量时，可以合成为机甲。战役中的BOSS均会掉落各种机甲专属零件。"] = "当某一种机甲专属零件收集到一定数量时，可以合成为机甲。战役中的BOSS均会掉落各种机甲专属零件。"
GuidebookTemplateLang["※万能零件※"] = "※万能零件※"
GuidebookTemplateLang["消耗一定数量的万能零件，可以兑换所需要的高品质机甲。\n普通万能零件可以在机甲库的普通合成列表中兑换紫色机甲，高级万能零件可以在机甲库的高级合成列表中兑换橙色机甲。\n如果有不需要的机甲，可以将其分解为万能零件。同时也可以在各种活动中获得万能零件。"] = "消耗一定数量的万能零件，可以兑换所需要的高品质机甲。\n普通万能零件可以在机甲库的普通合成列表中兑换紫色机甲，高级万能零件可以在机甲库的高级合成列表中兑换橙色机甲。\n如果有不需要的机甲，可以将其分解为万能零件。同时也可以在各种活动中获得万能零件。"
GuidebookTemplateLang["※配件※"] = "※配件※"
GuidebookTemplateLang["所有机甲，均可装备配件。\n武器配件，分为破甲弹（破甲攻击）、爆裂弹（爆裂攻击）两种。破甲弹可以装备于支援、炮击、狙击；爆裂弹可以装备于突击、重击。\n装甲配件、推进器配件、反应炉配件，可以装备于所有类型的机甲。"] = "所有机甲，均可装备配件。\n武器配件，分为破甲弹（破甲攻击）、爆裂弹（爆裂攻击）两种。破甲弹可以装备于支援、炮击、狙击；爆裂弹可以装备于突击、重击。\n装甲配件、推进器配件、反应炉配件，可以装备于所有类型的机甲。"
GuidebookTemplateLang["※破甲攻击※"] = "※破甲攻击※"
GuidebookTemplateLang["支援、炮击、狙击的所有攻击均为破甲攻击。"] = "支援、炮击、狙击的所有攻击均为破甲攻击。"
GuidebookTemplateLang["※爆裂攻击※"] = "※爆裂攻击※"
GuidebookTemplateLang["突击、重击的所有攻击均为爆裂攻击。"] = "突击、重击的所有攻击均为爆裂攻击。"
GuidebookTemplateLang["※破甲防御※"] = "※破甲防御※"
GuidebookTemplateLang["破甲防御代表机甲抵御破甲攻击的能力。\n数值越大，机甲对破甲攻击的防御能力就越强。"] = "破甲防御代表机甲抵御破甲攻击的能力。\n数值越大，机甲对破甲攻击的防御能力就越强。"
GuidebookTemplateLang["※爆裂防御※"] = "※爆裂防御※"
GuidebookTemplateLang["爆裂防御代表机甲抵御爆裂攻击的能力。\n数值越大，机甲对爆裂攻击的防御能力就越强。"] = "爆裂防御代表机甲抵御爆裂攻击的能力。\n数值越大，机甲对爆裂攻击的防御能力就越强。"
GuidebookTemplateLang["※生命※"] = "※生命※"
GuidebookTemplateLang["生命值代表机甲能承受的最大累计伤害。\n当生命为0时，该辆机甲将损毁，无法继续战斗。"] = "生命值代表机甲能承受的最大累计伤害。\n当生命为0时，该辆机甲将损毁，无法继续战斗。"
GuidebookTemplateLang["※速度※"] = "※速度※"
GuidebookTemplateLang["速度代表机甲的机动性。\n综合速度高的一方，将在战斗中获得先手。"] = "速度代表机甲的机动性。\n综合速度高的一方，将在战斗中获得先手。"
GuidebookTemplateLang["※暴击※"] = "※暴击※"
GuidebookTemplateLang["暴击代表机甲攻击时产生致命一击的能力。\n致命一击区别于普通攻击的特点是伤害大幅提升。\n暴击数值越大，机甲攻击时越容易产生致命一击效果。"] = "暴击代表机甲攻击时产生致命一击的能力。\n致命一击区别于普通攻击的特点是伤害大幅提升。\n暴击数值越大，机甲攻击时越容易产生致命一击效果。"
GuidebookTemplateLang["※暴击伤害※"] = "※暴击伤害※"
GuidebookTemplateLang["暴击伤害是机甲在产生致命一击效果时，额外附加的伤害。\n暴击伤害数值越大，机甲攻击在发生暴击时，造成的伤害就越多。"] = "暴击伤害是机甲在产生致命一击效果时，额外附加的伤害。\n暴击伤害数值越大，机甲攻击在发生暴击时，造成的伤害就越多。"
GuidebookTemplateLang["※坚韧※"] = "※坚韧※"
GuidebookTemplateLang["坚韧代表机甲抵御暴击的能力。\n数值越大，机甲对暴击效果的防御能力就越强，被敌方机甲击中时越不容易产生暴击。"] = "坚韧代表机甲抵御暴击的能力。\n数值越大，机甲对暴击效果的防御能力就越强，被敌方机甲击中时越不容易产生暴击。"
GuidebookTemplateLang["※命中※"] = "※命中※"
GuidebookTemplateLang["命中代表机甲击中目标的能力。\n数值越大，机甲在攻击中越不容易出现未命中的情况。"] = "命中代表机甲击中目标的能力。\n数值越大，机甲在攻击中越不容易出现未命中的情况。"
GuidebookTemplateLang["※闪避※"] = "※闪避※"
GuidebookTemplateLang["闪避代表机甲免于被击中的能力。\n数值越大，机甲在战斗中越容易闪避敌人的攻击。"] = "闪避代表机甲免于被击中的能力。\n数值越大，机甲在战斗中越容易闪避敌人的攻击。"
GuidebookTemplateLang["※配件碎片※"] = "※配件碎片※"
GuidebookTemplateLang["挑战战役和开启宝箱时有机率获得某些配件的碎片，获得某一个配件的碎片后，便可以在配件抢夺玩法中找到对应的配件进行抢夺。"] = "挑战战役和开启宝箱时有机率获得某些配件的碎片，获得某一个配件的碎片后，便可以在配件抢夺玩法中找到对应的配件进行抢夺。"
GuidebookTemplateLang["※经验※"] = "※经验※"
GuidebookTemplateLang["挑战战役可以获得经验，经验可以提升主角等级。点击主角头像，可以看到主角的等级与经验。"] = "挑战战役可以获得经验，经验可以提升主角等级。点击主角头像，可以看到主角的等级与经验。"
GuidebookTemplateLang["※推进剂※"] = "※推进剂※"
GuidebookTemplateLang["挑战战役和争霸活动需要消耗对应推进剂：1.推进剂会随时间恢复 2.每日可领取3次各60点推进剂 3.提升等级或VIP可增加推进剂上限，每提升25级可提升3点上限。"] = "挑战战役和争霸活动需要消耗对应推进剂：1.推进剂会随时间恢复 2.每日可领取3次各60点推进剂 3.提升等级或VIP可增加推进剂上限，每提升25级可提升3点上限。"
GuidebookTemplateLang["※科技图纸※"] = "※科技图纸※"
