TankDataTemplateLang["_SPACE_"] = ""
TankDataTemplateLang["飞翼高达"] = "飞翼高达"
TankDataTemplateLang["以Wing Zero为设计原型研发，用于破袭战方面的高性能试作型机体，于A.C.194年在L1地群完成后，参与了殖民地方面于次年发动的“流星行动”，在行动中被送到地球，4月7日凌晨在南JAP点上空的成圈层内首次与OZ军的巡逻队交战，事后OZ军方的资料记录上将其统一称呼为“GUNDAM 01”。"] = "以Wing Zero为设计原型研发，用于破袭战方面的高性能试作型机体，于A.C.194年在L1地群完成后，参与了殖民地方面于次年发动的“流星行动”，在行动中被送到地球，4月7日凌晨在南JAP点上空的成圈层内首次与OZ军的巡逻队交战，事后OZ军方的资料记录上将其统一称呼为“GUNDAM 01”。"
TankDataTemplateLang["倒A高达"] = "倒A高达"
TankDataTemplateLang["本机是自月面环型山中发掘出来的黑历史遗留下的机体，开发的年代及机体的具体性能都是个谜。从黑历史遗留下来的资料来看，TURN A高达是由地球方面为镇压宇宙殖民地而制造的机体，曾经在战斗中重创过同类机体TURN X高达，最后还一度毁灭了地球上的人类文明。"] = "本机是自月面环型山中发掘出来的黑历史遗留下的机体，开发的年代及机体的具体性能都是个谜。从黑历史遗留下来的资料来看，TURN A高达是由地球方面为镇压宇宙殖民地而制造的机体，曾经在战斗中重创过同类机体TURN X高达，最后还一度毁灭了地球上的人类文明。"
TankDataTemplateLang["专用型高机动型扎古Ⅱ"] = "专用型高机动型扎古Ⅱ"
TankDataTemplateLang["MS-11计划经过修订，重新开始了设计工作，而吉翁尼克公司的工程师们作出了改进渣古性能的最后尝试，并希望它能继续量产，这种努力的结果就是出现了MS-06R-2型高机动渣古，这是MS-06R-2P的简化生产型。这种型号的MS沿用了MS-06R-1的核子融合炉，专用型加强了光线武器的能力。"] = "MS-11计划经过修订，重新开始了设计工作，而吉翁尼克公司的工程师们作出了改进渣古性能的最后尝试，并希望它能继续量产，这种努力的结果就是出现了MS-06R-2型高机动渣古，这是MS-06R-2P的简化生产型。这种型号的MS沿用了MS-06R-1的核子融合炉，专用型加强了光线武器的能力。"
TankDataTemplateLang["金"] = "金"
TankDataTemplateLang["本机是ZAFT军所开发的泛用量产型MS。为了弥补与地球联合军方面巨大的战力差距，ZAFT军开发了这一款能够在中子干扰下作战的机动兵器。本机的泛用性极为优秀，可根据不同的情况选装不同的武器以应对。"] = "本机是ZAFT军所开发的泛用量产型MS。为了弥补与地球联合军方面巨大的战力差距，ZAFT军开发了这一款能够在中子干扰下作战的机动兵器。本机的泛用性极为优秀，可根据不同的情况选装不同的武器以应对。"
TankDataTemplateLang["精神感应高达"] = "精神感应高达"
TankDataTemplateLang["MRX-009精神感应高达，本机是日本村雨研究所开发的大型可变MA，即有名的精神感应高达。是联邦军第一台真正的NT专用机。火器管制及机体控制都导入了赛可谬系统。重量超过了200顿的超大型机。MA形态时，运用了米诺夫斯基浮游原理，因此能够长时间在地球上空飞行。"] = "MRX-009精神感应高达，本机是日本村雨研究所开发的大型可变MA，即有名的精神感应高达。是联邦军第一台真正的NT专用机。火器管制及机体控制都导入了赛可谬系统。重量超过了200顿的超大型机。MA形态时，运用了米诺夫斯基浮游原理，因此能够长时间在地球上空飞行。"
TankDataTemplateLang["TROP 热带型大魔"] = "TROP 热带型大魔"
TankDataTemplateLang["热带型大魔是以MS-09F大魔F为基础进行了防尘处理而得到的机体，主要适用于沙漠战，是特地为非洲战线部队开发的局地战用机体。机体名里的“TROPEN”是德语，意即“热带”。热带型大魔增加了额外的沙尘过滤装置来保护MS机体内的设备，并配有大功率制冷系统克服沙漠地区的高温。"] = "热带型大魔是以MS-09F大魔F为基础进行了防尘处理而得到的机体，主要适用于沙漠战，是特地为非洲战线部队开发的局地战用机体。机体名里的“TROPEN”是德语，意即“热带”。热带型大魔增加了额外的沙尘过滤装置来保护MS机体内的设备，并配有大功率制冷系统克服沙漠地区的高温。"
TankDataTemplateLang["席古"] = "席古"
TankDataTemplateLang["扎夫特的ZGMF-515 席古是标准机体ZGMF-1017 金的进化型，它是为劳・卢・克尔泽这样的指挥官和王牌机师而设计的。CGUE比标准的GINN要快，机动性也比其强，他们的武装也有所不同。"] = "扎夫特的ZGMF-515 席古是标准机体ZGMF-1017 金的进化型，它是为劳・卢・克尔泽这样的指挥官和王牌机师而设计的。CGUE比标准的GINN要快，机动性也比其强，他们的武装也有所不同。"
TankDataTemplateLang["加撒D改 MA"] = "加撒D改 MA"
TankDataTemplateLang["本机是作为阿克西斯的新吉恩军最初的量产型MS―AMX-003 加撒C的发展型而开发的机体。在更改了武器系统后，本机火力得到了全面增强，追加了两个14连装导弹发射器及两个4连装导弹发射器。与加撒C相比，本机的MS形态的战斗力得到了大幅度的提高。"] = "本机是作为阿克西斯的新吉恩军最初的量产型MS―AMX-003 加撒C的发展型而开发的机体。在更改了武器系统后，本机火力得到了全面增强，追加了两个14连装导弹发射器及两个4连装导弹发射器。与加撒C相比，本机的MS形态的战斗力得到了大幅度的提高。"
TankDataTemplateLang["高达Mk-Ⅱ"] = "高达Mk-Ⅱ"
TankDataTemplateLang["本机是泰坦斯作为次期专用主力战力而在格利普斯1号独立秘密开发的MS。其原型机是一年战争期间著名的“RX-78 GUNDAM”，新型机具有很高的潜力。"] = "本机是泰坦斯作为次期专用主力战力而在格利普斯1号独立秘密开发的MS。其原型机是一年战争期间著名的“RX-78 GUNDAM”，新型机具有很高的潜力。"
TankDataTemplateLang["强人"] = "强人"
TankDataTemplateLang["强人系列是兹玛德公司推出的在“光束武器必须成为MS的标准配置”概念下开发的用以对抗联邦军RX系列MS的新型机体。因为旧式发电机的出力无法达到使用光束兵器的要求，而新型的发电机体积又相对较大，这样就要求设计人员必须对机体内部构造进行全新的设计。"] = "强人系列是兹玛德公司推出的在“光束武器必须成为MS的标准配置”概念下开发的用以对抗联邦军RX系列MS的新型机体。因为旧式发电机的出力无法达到使用光束兵器的要求，而新型的发电机体积又相对较大，这样就要求设计人员必须对机体内部构造进行全新的设计。"
TankDataTemplateLang["F91"] = "F91"
TankDataTemplateLang["本机是由联邦海军战略研究所所进行的小型MS“F计划”中诞生的试作型MS，是以“达到目前MS的极限性能”为目标而开发的机体。开发时以F90V为基础，搭载了高出力的发电机；武器方面则装备了可变速光束步枪及光束盾牌；还装备了生物电脑系统以辅助操作，大幅度提高了机体的追踪性能。"] = "本机是由联邦海军战略研究所所进行的小型MS“F计划”中诞生的试作型MS，是以“达到目前MS的极限性能”为目标而开发的机体。开发时以F90V为基础，搭载了高出力的发电机；武器方面则装备了可变速光束步枪及光束盾牌；还装备了生物电脑系统以辅助操作，大幅度提高了机体的追踪性能。"
TankDataTemplateLang["Z高达・3A型 MA"] = "Z高达・3A型 MA"
TankDataTemplateLang["Z高达・3A型Z高达的一个变种，又被称为“白色Z高达”，与Z高达相比，该机并没有安装生物传感器，曾与另外两台Z高达衍生机一同与泰坦斯的杰米努斯发生战斗。"] = "Z高达・3A型Z高达的一个变种，又被称为“白色Z高达”，与Z高达相比，该机并没有安装生物传感器，曾与另外两台Z高达衍生机一同与泰坦斯的杰米努斯发生战斗。"
TankDataTemplateLang["大扎姆"] = "大扎姆"
TankDataTemplateLang["大扎姆，机动战士敢达机体之一，这部机体最奇特的地方是其第一次搭载了I FIELD发生器，此发生器能在机体周围形成一层对光束用电磁波膜，能将战舰主炮级光束兵器所发射的光束有效的化解。"] = "大扎姆，机动战士敢达机体之一，这部机体最奇特的地方是其第一次搭载了I FIELD发生器，此发生器能在机体周围形成一层对光束用电磁波膜，能将战舰主炮级光束兵器所发射的光束有效的化解。"
TankDataTemplateLang["梅塔斯"] = "梅塔斯"
TankDataTemplateLang["本机是“Z计划”中试制的可变式MS之一。机体的形状还是计划初期时的样式，它其实是为了检验变形机构而特意试作的，但也是奥古的第一台可变MS。变为 MA形态时，成为一架宇航战斗机，武装只有两门前臂光束枪，攻击力虽尚可，但种类实在太少了，变形机构的完成使本机具有很强的运动性和加速性，这点十分受前线士兵的欢迎。"] = "本机是“Z计划”中试制的可变式MS之一。机体的形状还是计划初期时的样式，它其实是为了检验变形机构而特意试作的，但也是奥古的第一台可变MS。变为 MA形态时，成为一架宇航战斗机，武装只有两门前臂光束枪，攻击力虽尚可，但种类实在太少了，变形机构的完成使本机具有很强的运动性和加速性，这点十分受前线士兵的欢迎。"
TankDataTemplateLang["力克戴亚斯"] = "力克戴亚斯"
TankDataTemplateLang["本机是阿纳海姆为奥古秘密开发的史上最早的次世代MS，分类为攻击用量产机，也是第一台使用了“高达尼姆γ合金”作为装甲材料的量产型MS，从而成功地大幅降低了机体的重量，增加了推进剂的装载量，使作战半径更为延长。"] = "本机是阿纳海姆为奥古秘密开发的史上最早的次世代MS，分类为攻击用量产机，也是第一台使用了“高达尼姆γ合金”作为装甲材料的量产型MS，从而成功地大幅降低了机体的重量，增加了推进剂的装载量，使作战半径更为延长。"
TankDataTemplateLang["梅萨拉 MA"] = "梅萨拉 MA"
TankDataTemplateLang["为了摆脱木星的强大重力，该机特别对发动机进行了强化，还搭载了大推力助推器。该机变形成MA形态时具有极为优秀的性能，装备有2门高能粒子炮及导弹舱，火力可与战舰相媲美；变形成MS形态时，机体高度超过30米，是一种超大型机械，装备有大型光束刀，榴弹发射器等武器，中、近距离内也能发挥出强大的战斗力，是一台相当出色的MA。"] = "为了摆脱木星的强大重力，该机特别对发动机进行了强化，还搭载了大推力助推器。该机变形成MA形态时具有极为优秀的性能，装备有2门高能粒子炮及导弹舱，火力可与战舰相媲美；变形成MS形态时，机体高度超过30米，是一种超大型机械，装备有大型光束刀，榴弹发射器等武器，中、近距离内也能发挥出强大的战斗力，是一台相当出色的MA。"
TankDataTemplateLang["阿普萨拉斯III"] = "阿普萨拉斯III"
TankDataTemplateLang["吉翁公国军的据点攻击用试作型MA，是以阿普萨拉斯二世的数据为基础进行开发而得到的试作3号机。由于前两作在飞行中需要消耗大量的电力，而机体自身搭载的单体反应炉本身的发电量提供不了如此巨量的电力。所以该机娘除了搭载两台“米诺夫斯基悬浮器”以保持飞行时的稳定性，外观和体积也比前作有了极大的不同，大概是前作的两倍之长。"] = "吉翁公国军的据点攻击用试作型MA，是以阿普萨拉斯二世的数据为基础进行开发而得到的试作3号机。由于前两作在飞行中需要消耗大量的电力，而机体自身搭载的单体反应炉本身的发电量提供不了如此巨量的电力。所以该机娘除了搭载两台“米诺夫斯基悬浮器”以保持飞行时的稳定性，外观和体积也比前作有了极大的不同，大概是前作的两倍之长。"
TankDataTemplateLang["吉姆 水中型"] = "吉姆 水中型"
