TankDataTemplateLang["勇士A"] = "勇士A"
TankDataTemplateLang["先行量产型勇士是一年战争时期吉翁军最后的量产型MS。在战争的初期，称雄战场的是扎古Ⅱ，但随着联邦也开始生产MS来对抗吉翁军，扎古系列的优势便逐渐丧失了。而大魔系列的性能也不能完全满足在宇宙中进行大规模MS战的需要。"] = "先行量产型勇士是一年战争时期吉翁军最后的量产型MS。在战争的初期，称雄战场的是扎古Ⅱ，但随着联邦也开始生产MS来对抗吉翁军，扎古系列的优势便逐渐丧失了。而大魔系列的性能也不能完全满足在宇宙中进行大规模MS战的需要。"
TankDataTemplateLang["扎古勇士 烈焰型+"] = "扎古勇士 烈焰型+"
TankDataTemplateLang["本机是扎古勇士搭载了焰型Wizard背包后得到的机体，技术人员在机体的背面加装了大型推进器及诱导导弹，提高了本机的机动性和火力。除了扎古的基本武装，焰型扎古的装备包中还配备了“火蜂”导弹。"] = "本机是扎古勇士搭载了焰型Wizard背包后得到的机体，技术人员在机体的背面加装了大型推进器及诱导导弹，提高了本机的机动性和火力。除了扎古的基本武装，焰型扎古的装备包中还配备了“火蜂”导弹。"
TankDataTemplateLang["核战机"] = "核战机"
TankDataTemplateLang["核心机主要是变形后与机机动战士的上半身和下半身相连接作为驾驶舱，并在紧急情况下作为逃生舱使用。因为核心机本身的火力弱小，因此飞机形态下一般作为侦查机使用。"] = "核心机主要是变形后与机机动战士的上半身和下半身相连接作为驾驶舱，并在紧急情况下作为逃生舱使用。因为核心机本身的火力弱小，因此飞机形态下一般作为侦查机使用。"
