TankDataTemplateLang["Ⅳ号自行反机甲炮是利用Ⅳ号机甲底盘发展出的三种主要衍生型之一。本车系用以替代Ⅲ号突击炮，其开发违背了装甲兵总监海因茨・古德里安的期望。古德里安认为不必要转移Ⅳ号机甲的生产资源，因为Ⅲ号、Ⅳ号突击炮能够充分胜任它们的角色。"] = "Ⅳ号自行反机甲炮是利用Ⅳ号机甲底盘发展出的三种主要衍生型之一。本车系用以替代Ⅲ号突击炮，其开发违背了装甲兵总监海因茨・古德里安的期望。古德里安认为不必要转移Ⅳ号机甲的生产资源，因为Ⅲ号、Ⅳ号突击炮能够充分胜任它们的角色。"
