TankDataTemplateLang["卡尔斯J"] = "卡尔斯J"
TankDataTemplateLang["本机是新吉恩军为侵攻地球而开发的陆战用MS。与几乎同时期开发的AMX-009 德莱森相比，本机的综合性能不及后者；但由于搭载了指部4连装发射器、铁拳等实验性的装备，使机体的生产性大大地提高了。最终本机实现了量产化并大量投入到了战场。"] = "本机是新吉恩军为侵攻地球而开发的陆战用MS。与几乎同时期开发的AMX-009 德莱森相比，本机的综合性能不及后者；但由于搭载了指部4连装发射器、铁拳等实验性的装备，使机体的生产性大大地提高了。最终本机实现了量产化并大量投入到了战场。"
TankDataTemplateLang["龟霸"] = "龟霸"
TankDataTemplateLang["龟霸是在兹卡克之后开发简易型水陆两用MS，由于可以使用MS-06F型的部件，实战配备的时间反而比MSM-07要早。本机虽然整体性能不高，但由于其反应炉经过开放式水冷改造，因此放出热量极少；机体的表面还涂有电波、红外线吸收剂，因此隐蔽性很高，常用于侦察或隐秘作战。大战末期加布罗攻略战中就有本型机成功潜入直布罗陀。"] = "龟霸是在兹卡克之后开发简易型水陆两用MS，由于可以使用MS-06F型的部件，实战配备的时间反而比MSM-07要早。本机虽然整体性能不高，但由于其反应炉经过开放式水冷改造，因此放出热量极少；机体的表面还涂有电波、红外线吸收剂，因此隐蔽性很高，常用于侦察或隐秘作战。大战末期加布罗攻略战中就有本型机成功潜入直布罗陀。"
