TankDataTemplateLang["汉布拉比是联邦军开发的可变型MS，由亚赞・盖博等人担任驾驶，全身装有5个寻物探测器，因此无论是在MS形态还是在MA形态，都能轻松地探测到敌人的踪迹。机体各处都安装了自动稳定器，使整机具有极高的运动性能。变为MA形态时，机身缩短，惯性距离小，机动性得到了提高，达到了宇航战斗机的水平。"] = "汉布拉比是联邦军开发的可变型MS，由亚赞・盖博等人担任驾驶，全身装有5个寻物探测器，因此无论是在MS形态还是在MA形态，都能轻松地探测到敌人的踪迹。机体各处都安装了自动稳定器，使整机具有极高的运动性能。变为MA形态时，机身缩短，惯性距离小，机动性得到了提高，达到了宇航战斗机的水平。"
TankDataTemplateLang["加撒D MA"] = "加撒D MA"
TankDataTemplateLang["本机是作为阿克西斯的新吉恩军最初的量产型MS――AMX-003加撒C的发展型而开发的机体。由于基本的机体变形机构与加撒C相同，所以不必新建生产线，只需变更一部分部件即可量产，因此，本机很快便代替了加撒C成为了新吉恩宇宙军的主力MS，全面投入到了第一次新吉恩战争。"] = "本机是作为阿克西斯的新吉恩军最初的量产型MS――AMX-003加撒C的发展型而开发的机体。由于基本的机体变形机构与加撒C相同，所以不必新建生产线，只需变更一部分部件即可量产，因此，本机很快便代替了加撒C成为了新吉恩宇宙军的主力MS，全面投入到了第一次新吉恩战争。"
TankDataTemplateLang["勇士++"] = "勇士++"
TankDataTemplateLang["本机是一年战争时期吉恩军最后的量产型MS，泛用量产型MS。本机是一年战争时期吉翁军最后的量产型MS。“勇士”有着非常良好的泛用性，使其活动范围能不局限于宇宙中，还可以在重力下作战，因此有少数被送往了地球使用。这些机体便被称为G型“勇士”。"] = "本机是一年战争时期吉恩军最后的量产型MS，泛用量产型MS。本机是一年战争时期吉翁军最后的量产型MS。“勇士”有着非常良好的泛用性，使其活动范围能不局限于宇宙中，还可以在重力下作战，因此有少数被送往了地球使用。这些机体便被称为G型“勇士”。"
