TankDataTemplateLang["本机是一年战争后，联邦军初次开发、生产的泛用量产型机体，设计的基本思想以旧吉恩军的MS-06 扎古为原型，因此，称之为新机型倒不如说是改进型。指挥官型增加了信号针。"] = "本机是一年战争后，联邦军初次开发、生产的泛用量产型机体，设计的基本思想以旧吉恩军的MS-06 扎古为原型，因此，称之为新机型倒不如说是改进型。指挥官型增加了信号针。"
