TankDataTemplateLang["本机以对机体的上半身装甲进行强化作为开发的重点，使得扎古的机枪无法贯穿装甲，驾驶员的生还率也因此大为提高。一年战争时期，MS在进行地面战时，常常会因为树木、建筑物等障碍物的阻碍而使得机体上半身很容易被击中。为了改变这种情况，以RGM-79 GM为原型而特地设计了本机，本机主要出现在欧洲战场上。"] = "本机以对机体的上半身装甲进行强化作为开发的重点，使得扎古的机枪无法贯穿装甲，驾驶员的生还率也因此大为提高。一年战争时期，MS在进行地面战时，常常会因为树木、建筑物等障碍物的阻碍而使得机体上半身很容易被击中。为了改变这种情况，以RGM-79 GM为原型而特地设计了本机，本机主要出现在欧洲战场上。"
