TankDataTemplateLang["梅比乌斯零式改良型MA。本机是地球联合军以“梅比乌斯”为基础进行改良后得到的改良型MA。机体装备了4门线控式炮筒及线形枪，附属的“线控式炮筒”敏捷地展开后，以独特的动作向目标进行扫射。这套武器可以对死角或同时对复数目标发动攻击。"] = "梅比乌斯零式改良型MA。本机是地球联合军以“梅比乌斯”为基础进行改良后得到的改良型MA。机体装备了4门线控式炮筒及线形枪，附属的“线控式炮筒”敏捷地展开后，以独特的动作向目标进行扫射。这套武器可以对死角或同时对复数目标发动攻击。"
