TankDataTemplateLang["德莱森"] = "德莱森"
TankDataTemplateLang["本机为新吉恩为执行“地球降下作战”计划而开发的MS。从外型就能看出来，本机有着浓郁的大魔系列的风格。本机的装备有三翼旋刃、光束斧兼光束长枪等独特的兵器，擅长于白兵战。原设计为陆战用MS，但因其基本性能优良，即使在宇宙中也可以充分发挥出它的性能。"] = "本机为新吉恩为执行“地球降下作战”计划而开发的MS。从外型就能看出来，本机有着浓郁的大魔系列的风格。本机的装备有三翼旋刃、光束斧兼光束长枪等独特的兵器，擅长于白兵战。原设计为陆战用MS，但因其基本性能优良，即使在宇宙中也可以充分发挥出它的性能。"
