TankDataTemplateLang["本机是地球联合在中立国奥布所有的资源卫星赫利奥波利斯上极为机密开发的五架MS中的一架。可对应战况的不同而换装3种不同的选装部件成为中距离机动战型强袭高达、炮战型强袭高达和近距离格斗战剑装备型强袭高达。在赫利奥波利斯时本机所使用的操作系统还很不完全，使机体连走路这样简单的动作都非常困难，但经过新人类少年吉良的改良后，操作性得到飞跃性的提高。"] = "本机是地球联合在中立国奥布所有的资源卫星赫利奥波利斯上极为机密开发的五架MS中的一架。可对应战况的不同而换装3种不同的选装部件成为中距离机动战型强袭高达、炮战型强袭高达和近距离格斗战剑装备型强袭高达。在赫利奥波利斯时本机所使用的操作系统还很不完全，使机体连走路这样简单的动作都非常困难，但经过新人类少年吉良的改良后，操作性得到飞跃性的提高。"
