TankDataTemplateLang["本机是阿纳海姆电子公司的可变MS开发计划――“Z计划”里MSZ-006 Z高达的原型机。由于获得了泰坦斯的RX-178 高达MkⅡ，阿纳海姆电子公司的技术人员在分析了该机之后迅速掌握了可变式框架等相关的关键技术，制造了三架试作型Z高达用以测试，使得MSZ-006能在短时间内完成。"] = "本机是阿纳海姆电子公司的可变MS开发计划――“Z计划”里MSZ-006 Z高达的原型机。由于获得了泰坦斯的RX-178 高达MkⅡ，阿纳海姆电子公司的技术人员在分析了该机之后迅速掌握了可变式框架等相关的关键技术，制造了三架试作型Z高达用以测试，使得MSZ-006能在短时间内完成。"
