TankDataTemplateLang["测试用杰刚是以杰刚为母体进行改造后得到的专门用作记录F90 高达的测试数据的机体，与原型机相比，该机主要强化了传感器的探测功能，技术人员在机体两肩装备了大型整流罩及可动式大型复合传感器，头部的传感器也进行了大型化处理，可进行广范围的探测。"] = "测试用杰刚是以杰刚为母体进行改造后得到的专门用作记录F90 高达的测试数据的机体，与原型机相比，该机主要强化了传感器的探测功能，技术人员在机体两肩装备了大型整流罩及可动式大型复合传感器，头部的传感器也进行了大型化处理，可进行广范围的探测。"
TankDataTemplateLang["决斗高达"] = "决斗高达"
TankDataTemplateLang["本机，是地球联合军在赫利奥波利斯秘密开发的五架高达之一，在五架机体中属于使用X100系框架的标准泛用型机体，名称中的“Duel”是“决斗、斗争”的意思，机体色由蓝色及浅灰色构成。这架机体的盾牌等基本武装与强袭高达一样，原本设计还有火箭炮等武器，但由于在赫利奥波利斯完成后被ZAFT强夺而未能实现。"] = "本机，是地球联合军在赫利奥波利斯秘密开发的五架高达之一，在五架机体中属于使用X100系框架的标准泛用型机体，名称中的“Duel”是“决斗、斗争”的意思，机体色由蓝色及浅灰色构成。这架机体的盾牌等基本武装与强袭高达一样，原本设计还有火箭炮等武器，但由于在赫利奥波利斯完成后被ZAFT强夺而未能实现。"
