TankDataTemplateLang["本机是作为吉恩的后继机体而设计开发的泛用量产型MS。从涂装上看，可分为标准型及指挥官专用型。本机引入了部分正义高达及自由高达所采用的新技术，其性能凌驾于ZAFT军的次期主力机。虽然是量产机，但本型机的生产数量并不多。在门德尔遭遇战中，克鲁泽曾驾驶本机与穆交战，轻易将强袭高达击败。次机型进行了银色涂装。"] = "本机是作为吉恩的后继机体而设计开发的泛用量产型MS。从涂装上看，可分为标准型及指挥官专用型。本机引入了部分正义高达及自由高达所采用的新技术，其性能凌驾于ZAFT军的次期主力机。虽然是量产机，但本型机的生产数量并不多。在门德尔遭遇战中，克鲁泽曾驾驶本机与穆交战，轻易将强袭高达击败。次机型进行了银色涂装。"
TankDataTemplateLang["T-44机甲是前苏联在第二次宇宙战争开始生产的一种中型机甲，用以取代当时大量服役的T-34机甲。对比于T-34以及后来的T-54/55机甲，T-44生产的很少，约2000辆左右。不过这辆机甲的诸多设计被沿用在稍后服役的T54/55与T-62等机甲上。"] = "T-44机甲是前苏联在第二次宇宙战争开始生产的一种中型机甲，用以取代当时大量服役的T-34机甲。对比于T-34以及后来的T-54/55机甲，T-44生产的很少，约2000辆左右。不过这辆机甲的诸多设计被沿用在稍后服役的T54/55与T-62等机甲上。"
